INSERT INTO `Fall2007Cast_profiles` VALUES (2,'Andrew Chung (duma nes)','3rd/PEIS/3rd','To create beautiful works of art with like minded individuals','Listening to music, watching films, playing basketball, being\r\nspontaneous just for the hell of it','Film and rappin','I want to touch new horizons and hold it ','My jiggly calves cuz they jiggly!','Batman but Aquaman needs some love','I enjoy the smell of freezer','Awkwardness','Family','A pug and a monkey','Tupac! Power Rangers Mastodon! Pacino mang!','Mi padre y mi hermana ','Andrew1.jpg','Andrew2.jpg'),(3,'Jim\"the\"Chin','2nd year/History/2nd Semester-','Because Rice is delicious. And so is theatre. At the same time?\r\nSheer excellence.','I play Warhammer 40k while biking to my creative writing seminar,\r\nwhich is only two blocks away from RSF combatives room.','Jigglypuff.','Aite, let\'s jiggle.','Eyes. It\'s great having two.','Immortal Iron Fist. He\'s got an Iron Fist!','I have hairy nipples.','My hairy nipples.\r\n','My hairy nipples.\r\n\r\n\r\n','A helicopter. and Gatorade.','I don\'t know any of those characters, except Pokemon.','You do, you safely ambiguous internet gawker, you.','Jim1.jpg','Jim2.jpg'),(4,'Yuepreet Singh Tu','2009/Industrial Engineering and Operations Research, Pre-Law/\r\nThis is my third semester','Anthony Wee (EECS \'08, Leland \'04) told me that it would be fun\r\nand I can use some of the skills I learned in Speech and Debate.','People watching, impersonations, sound effects, voices, and\r\nmaking sweet sweet love.','Don\'t have one. I suck.','Provide entertainment and lasting friendships.','The funny bone cuz it\'s funny. SHADAYAIM because they\'re fun.','Megan Fox cuz she\'s a superfox.','I like doing voices.','Spontaneity, genuine expressions, and Mendoza.','Dumb beeeeeeezies.','A silo full of grains and an airplane.','Tupac\r\nPower Rangers\r\nBob De Niro','the loWers','Yue1.jpg','Yue2.jpg'),(5,'Alejandro Antonio Joseph Navarrete Uy','Freshman 2011 / Civil Engineering / 1st TR Semester','I wanted to maintain and exponentially improve my theatrical skills.','I love subways and mass transportation (don\'t make fun of me). ','Music and thinking.','Happiness and a feeling of connection between me and the TR cast.','Appendages... ALL of them.','Connie because she is \"cool\". ','I am socially awkward and tend to be nervous before the public...\r\nand girls. Sometimes I feel like I\'m a main character in a sitcom. ','Everything.','Romantic stories, depressing relationships between families, and\r\nmost of all... unrequited love.','\"sand to food and water converter\" and \"tree to human converter\"','tupac (hes the only one i vaguely know). neither (i was into\r\n\"brio\" ). brando.','Right now? Connie Chiu...','Allen U1.jpg','Allen U2.jpg'),(6,'Eric Hsiao','Junior/Mass Communications, Sociology/1','I wanted to try something new.','Playing basketball, following professional and collegiate \r\nsports, studying cinema, eating food, sleeping in on weekends \r\n(and weekdays).','I\'m good at falling asleep at symphonies and in art galleries.','To receive a $20 million offer from a Hollywood studio.','The penis, because it\'s one of the only parts with multiple \r\nfunctions. And both functions are awesome.','Captain Underpants, because he\'s an inspiration to those who \r\ndislike wearing clothes.','I have an IQ of 215...give or take 250.','Other people\'s pain, suffering, and misfortunes. And puppies \r\nfalling asleep.','Solitary confinement in a maximum security prison.','Sunblock and a magic lamp.','Tupac. Pokemon. De Niro.','Myself. Jesus. Rupert Murdoch.','Eric1.jpg','Eric2.jpg'),(7,'Li-Chi Jerry Lee\r\nNicknames: Jerr-wheeee, Jelly (Asians who can\'t pronounce R),\r\nLaughing Leech, Chi-Chi, Li-Li, Jerry the Fairy, \r\nThe more common ones: Dork, nerd, ass, geek, moron, jerk, stupid,\r\nidiot,  dumbass','I\'m surprised I haven\'t heard \"Stupid Freshman\" yet.\r\nI plan to major in slacking off and minor in sitting on the couch\r\nwhile watching TV. But Pre-business sounds good for now.','I was expecting the meetings to involve a showing of a movie and\r\nfree rice related snacks.\r\nBoy was I pissed when I learned I was wrong.','Acting like a moron in front of friends, Karaoke, Children\'s card\r\ngames, television/anime, video games, basketball, dancing when no\r\none is looking, hanging out with friends, sitting around doing\r\nnothing, drawing, Talking to myself, talking to inanimate objects,','I have an artistic forte? No effing way.\r\nUh... I spew out random BS that has nothing to do with anything\r\nreally well?\r\nI\'m not that great in anything. More like I\'m mediocre in a\r\ncrapload of things.','Make friends, have fun, eat rice.','My ears.\r\nI love music.\r\nI love the voices of my friends.\r\n','Monkey D. Luffy\r\nHe reminds me of... me. Or, a part of me. I\'m already stupid and\r\nrandom like he is. All I need now is more of a carefree soul,\r\nconfident heart, and the ability to stretch like rubber at the\r\ncost of not being able to swim in the sea.','I have bladder problems?\r\nOnce I consider someone a close friend, I will forever remain\r\nloyal. Even if he/she puts me through hell, I won\'t ever leave.\r\nSome call it \"freakishly loyal.\" I sometimes see it as stubborn.','My friends. Being poked. Various Anime. Your face. Television\r\nsitcoms. Old people breakdancing. Midget parades. Your face.\r\nBloopers. Cute stuff. People saying stupid things. Your face.\r\n\r\nTo be honest. I laugh at almost everything. It\'s a bit\r\nembarrassing when your the only one laughing and everyone else is\r\ndead silent.','Men don\'t cry... Which is why I guess some of my friends always\r\ncall me a woman.\r\n\r\nSeeing my friends cry and not being able to help them.','I know what I would bring if it were THREE things.\r\nBut if I\'m limited to two, then I would like a map of the island\r\nand an unlimited supply of the local currency.\r\nIf it\'s a deserted island... Then a sketchbook and pencil.','Tupac.\r\nPokemon.\r\nPacino.\r\n... I don\'t get this game.','Bob the Builder. He can fix it, yes he can.\r\n\r\nPeople who constantly put others before themselves.','Jerry1.jpg','Jerry2.jpg'),(8,'Irene Shih','This is the first.','To explore acting and broaden my interests. To challenge myself\r\nto have fun.','Writing, Singing, Filming, Playing Piano, Biking','I think I\'m strongest as a writer.','To be challenged and to uncover new aspects of myself.','I like the way my hands look when I\'m playing the piano.','Rogue from X-Men. She can\'t get physically close with someone but\r\nthat doesn\'t stop her from kicking ass and taking names. A hero\r\nwith an identifiable struggle.','I hate warm seats, so I generally cringe at having to sit down in\r\na chair right after someone has just left it. You might just\r\ncatch me fanning it. The chair, that is.','Try me.','Being unjustly insulted. Not being appreciated. Pain. When I\r\nidentify with someone so deeply it feels like uncovering a layer\r\nof myself. Probably love, because not much else can hurt quite as\r\nmuch. And I have actually, believe it or not, laughed so hard I\r\ncried. Go figure.','Tortellini Alfredo and a multiplying pot.','Tupac. Power Rangers. Pacino. Judy Garland. Wait, what?','My best friends, who show me every day what it means to be a good\r\nperson and to really live life. I have much to learn.','Irenes1.jpg','Irenes2.jpg'),(9,'Jessica Chan','Year: well...it\'s currently the year \"2007\"\r\nMajor: undecided for now but it\'s going to be either mass \r\ncommunications or film studies (kind of leaning towards film \r\nmore)\r\nSemesters in Theatre Rice: 1st','I saw \"STFU\" and thought, \"I wanted to do that!\" hehe. ','hanging out with friends, listening to music, taking pictures, \r\neating, procrastinating...and much more? hehe.','umm...attending/watching musicals, movies, free movies at the \r\npark, concerts...and food...? hehe.','to be a little more outgoing, less shy, and act better','my hands because they are small and can reach into tight \r\nspots...like when one has to retrieve a golf ball because your \r\nfriend hit it inside one of those mini-golf houses and it got \r\nstuck in the pipe','Sailor Moon because she can sometimes be a total klutz, but she \r\nstill cares for the people around her. plus, she will \"right \r\nwrong and triumph over evil!\"','giggling...? does that count? hehe.','when something funny happens...','putting on my contacts sometimes...when i emotionally get \r\nhurt...watching others in pain...','a water filter and a plane. hehe.','...i don\'t know...don\'t make me choose! hehe.','family, friends, people who make me smile :)','Jessica C1.jpg','Jessica C2.jpg'),(10,'Tara Tomicevic','2nd Year/Mass Communications & Theater/1st Sem in TR','I was excited by the opportunity to do film, comedy, drama, and improv--all with the \r\nsame group of people. ','Acting! Entertainment industry buzz and Disney Channel-ish entertainment. ','Film acting','I want to become closer to the entire cast and make some really great friends. I also \r\nwant to expand my experience and progress as an actress. ','Hair. It\'s just pretty. ','Hilary Duff\'s my superhero. Why? She\'s Hilary Duff. ','My favorite actors are Sandra Bullock and Alan Rickman and yet I adore High School \r\nMusical (1 AND 2!)','Lines from Ms. Congeniality, Mrs. Doubtfire, Legally Blonde, and Meet the Parents. ','Unexpected showings of affection and the thought of sacrificing for loved ones. ','My laptop (with full Internet capabilities) and water. ','Neither. Both (Pika Pika more though). De Niro. ','My parents in one way and Sandra Bullock in another way. ','Tara1.jpg','Tara2.jpg'),(11,'Aly Wong','2nd year/English premed/ 3rd semester in Rice','Cuz Rice is family','Reading, cubing, cooking...','Writing','Learning to be a better director','my right ring finger.  BECAUSE.','Spiderman.  He\'s hot.','I have really fidgety fingers...thus my cubing obsession.','yo face.','guys.','A teddy bear and a pillow.  ','Who? Power Rangers? Who?','My father.','Aly1.jpg','Aly2.jpg'),(12,'Thaen C. Saefong','3rd/Sociology/First','I wanted to join Theatre Rice so i can discover who i am  \r\nreally am. At this point in my life i feel like i dont know who \r\ni really am and the type of person i can be. Plus you guys were \r\nthe only group that seem to be fun and diverse. After i saw one \r\nof TR show i told myself, \"that is a group i want to be part \r\nof\". ','I like to go to the beach, park, or any place in the wilderness \r\nand take pictures, reflect on things and just take a break from \r\nlife and technology. \r\n\r\nI also love to cook. My favorite dish to make is Chicken \r\nFetticini Alfreda with brocolli. and i make a killer lunch \r\nrolls, they are kind of like california rolls but with eggs, \r\nspam, avocado and cucumbers and rice. I also love cooking \r\nindegenious Mien and Thai cuisine. Beware though, it is spicy \r\nHOT and will burn your ass if you aren\'t use to it. =)\r\n\r\nBut of course the previous things mentioned are only best when \r\ndone with good friends and laughther (except the ass burning \r\npart, that you do alone in the bathroom.) ','I write poetry. People tell me i take good scenic pictures. My \r\nsister tells me i can sing (but she might be lying). ','This semester i want to learn about acting. I can already tell \r\nthat there is so much that the veterans have to offer. I just \r\nwant to get my feet wet and take risks. I kind of want to look \r\nstupid and make an ass of myself, because that is my greatest \r\nfear, humiliation. So, my objective is to just do whatever \r\ncomes to mind and not care if i look stupid. ','Hmm, on the member of the opposite sex? It would have to be \r\nstrong arms. Because it is nice to be held by them. But \r\ngenerally, it would have to be the eyes. A person\'s eyes can \r\ntell you a lot. It tells you if they are sad, mad, happy, blue, \r\nor in pain. ','My superhero has always been Salor Moon since it came out back \r\nin the 90\'s because she is \"fighting evil by moonlight, and \r\nwinning love by daylight, never running from a real fight, she \r\nis the one name Salor Moon. She is the ONE. SALOR MOON!\" =). \r\nPlease feel free to intrepret this. ','I have a big smile.','Anything that tickles my brain. ','I cry over many things. When i get a migraine and i can\'t see i \r\nstart crying. When i think about how seperated i am from my \r\nfamily tears start to form. When other people cry i cry. When i \r\ncan\'t help fix things i cry. I am a big cry baby. ','','Tupac. Power Ranger ( Go PINK RANGER!!) Pacino. ','There isn\'t really one person who inspires me. Throughout my \r\ndaily encounters, i find that many people inspires me. It can \r\nbe a complete stranger who commits an act of kindness or a \r\nclose friend who let me realize the importances of friendship.  \r\nI am inspire by the types of people who opens my eyes to new \r\nworlds and perspectives-those who help me change. These people \r\ninspire me to become a better person, to be a better friend, to \r\nhelp others and not be selfish. The list is endless, but \r\noverall inspiration to me is around each and every interaction. \r\nIts just how you transform it into an inspiring force. ','Thaen1.jpg','Thaen2.jpg'),(13,'Dennis Ren','Junior/Integrative Biology and Theater/2 semesters not counting\r\nsummer','Fun and friends','surviving the Berkeley wilderness, eating raw \"fish\" from\r\nStrawberry Creek, free-climbing the Campanile, studying for\r\nscience tests, watching nerds in Doe, skydiving into lakes','No clue','Have fun and meet new people','Bones. Orthopedic surgery is awesome.','Batman. He\'s just badass.','Hooting on occasion','Life','Onions','A magic lamp with a genie to grant me 3 wishes and just in case\r\nthat doesn\'t work, Bear Grylls.','Muse. Batman. Christian Bale.','Father','Dennis1.jpg','Dennis2.jpg'),(14,'Melvyn Manapsal','4th Year, yeah SENIORS!!!\r\nFilm Studies and Mass Communications double major\r\nThis is my 3rd semester in TR (including Summer of Rice =)!','Because I like it.','Taking pictures, watching anime, cooking and eating new things,\r\nsleeping, watching movies, playing games like Cranium and\r\nCharades and Pictionary','Singing. I love to sing :)','I don\'t want to hold anything back this semester and get to know\r\nas  many members as I can. Just to live in the moment.','Honestly, I\'d have to say... my butt because \"I like big butts\r\nand I cannot lie!\"','Storm because she\'s the only one I can think of right now','Apparently I scratch my arms after I wake up, so Michelle tells\r\nme. But I also have to replace the dish sponge every week because\r\nI don\'t like having it smelly and making my hands smell too =/','Awkwardness','Sappy movies, seeing other people cry, being sad, and laughing\r\nreally hard','A MAN so I can make my own babies, and if they\'re not smart\r\nenough to figure a way to get off the island, I\'ll eat them. and\r\nalso the Harry Potter series','Tupac. Power Rangers. De Niro.','My younger sister: she\'s hella smart. Also my roommates: they\'re\r\nawesomely inspiring.','Melvyn1.jpg','Melvyn2.jpg'),(15,'Daniel Jin Cho','First Year/ Undeclared, maybe Theatre/ First Semester in TR','Fell in love with theatre during 9th grade, I wish to get back\r\ninto it.','Tae Kwon Do, Skateboarding, Snowboarding, Singing, Dancing,\r\nActing,  Drawing, Kickin\' it with friends.','Randomness?','Simply do what I love and love doing it.','Hair and then eyes and then hands.','Atom Boy. HAHAHAHA','I need to make sure my bladder is empty before going to bed.\r\nLiterally go to the bathroom maybe three to four times before. :D','When bonds are made + inside jokes like \"Gap Kids\" or \"Is that a\r\nRolex?\"','When bonds are broken.','A Yacht, and a good friend.','Tupac, Power Rangers, and neither.','Not one person in particular but those that live and do what they\r\nlove to do with a passion so great that it\'s infectious. ','Jin1.jpg','Jin2.jpg'),(16,'Soojin \"Jina\" Youn','2/MCB/3rd','because i was a ricer in my pastlife.. i know it.. i can feel it\r\nin my bones','singing, writing music, attempting to rap, learning Chinese words\r\non the back of fortune cookie fortunes, watching tv online,\r\nsurprising people with my scandalous dancing :]','my experiments with words, black and white keys, and seven\r\nletters of the alphabet','go where no ricer has gone.','my left eyelid.\r\n\r\nit decided one day that it wanted to fold upon itself and become\r\na double lid.','Alice from Resident Evil. she\'s a hot ass-kicker.','i chew my tongue when i\'m concentrating on/thinking deeply about\r\nsomething','that funny little feeling in your heart. :]','that sad little feeling in your heart. :[','my memory and my sanity.','Tupac (don\'t know who Biggie is)\r\nPokemon (Power Rangers freaked me out as a little kid because\r\nthey would move around so much when they spoke)\r\nDe Niro (never saw The Godfather)','my older sister','Jina1.jpg','Jina2.jpg'),(17,'Dash','I\'m a junior, and English major and this is my FIRST semester in Theatre Rice.  Woot.','I joined Theatre Rice to celebrate my asian-ness!  Although, my white side feels \r\nneglected now.','When I was an ickle biddie tot I was a legomaniac, but now I\'m a legomaniac without \r\nthe L.  I\'m a rock star!!!  My hobbies include: Music, being great, losing at Halo, \r\ndancing in restaurants and elevators, and being a super hero.','Probably music.  Again!  rockstar!','I want to contribute to the awesomeness of the shows that we put on, but mostly I \r\nwant to have a really good time with a bunch of great people.','My favorite body part is... my head.  Because...  It\'s got my face on it.  Also I need it \r\nfor: thinking, looking pretty, seeing things, eating... you know, head stuff.','My favorite super-hero is Nightcrawler from the X-men.  Not only would teleportation \r\npower be freaking awesome, +bampf+, but he totally kicks Beast\'s ass as being coolest \r\nblue fuzzy guy on the team.','I spent the last hour trying to think of a personal idiosyncrasy.  I just realized that I \r\nspent an hour filling out one question on this form.  I think a personal idiosyncrasy is \r\nthat I worry way too much about making things perfect... even little things.  I\'ll never \r\nget that hour back.  Unless I invent a time machine.  I have much to do now.','Jokes.  A good sketch.  The movie \"Super Troopers\".  A well written book.  Tickles!  The \r\nbrand new game \"Pass The Twist\"!!!','The movie \"Bridge to Terrabithia\".  For real, watch that without crying and you are \r\nofficially some sort of robot, a robot that hasn\'t been programmed to cry.','A helicopter and a helicopter pilot?','I can honestly say I\'ve never heard a song by either Tupac or Biggie.  Not a huge fan of \r\nthe rap music.  Freaking Power Rangers all the way!!!  Only the original though, none of \r\nthat new shit.  Easily De Niro.  He was freaking Frankenstein\'s monster, \'Nuff said.','Douglas Adams.  If you haven\'t read \"The Hitchhikers Guide\" series or \"the Dirk Gently: \r\nHollistic Detective\" series your life is incomplete.','Dash1.jpg','Dash2.jpg'),(18,'John Qing-Wei Ng','Freshman/MCB-Philosophy-CogSci/1st semester','I wanted to join a theater group on campus and this was the \r\nfirst one that I found.','Video games, running, frisbee, cards, discussion, bowling, dance','Drawing?','I want to become a better actor, make new friends, and have fun!','Hands, they can do alot of stuff','Nightcrawler, cause he\'s got teleportation and he\'s fast.','I touch the edges of things.','I laugh at alot of things, whether its a joke, weird action, or \r\njust plain silliness','I usually only cry when something sentimental or close to me is \r\nsad, or if I\'m really upset about something','I would bring a submarine and a crew','POKEMON!!!','I would say that my inspiration comes from my inner self and God.','Jon1.jpg','Jon2.jpg'),(19,'Irene Van','1st year/Undeclared (woo!)/1st year in Theatre Rice','To get the opportunity to perform, to be a better and more\r\nversatile actress, to be funny, and just to have fun.','tennis, eating, dancing','I have an amazing sense of smell, especially for food. Is that\r\nartistic?','I want to get better at improv, expand as a person and an\r\nactress, and to meet some amazing people. :)','Hip bones on guys because they are \"oh so sexy\"','Batman because he doesn\'t need superhero powers to kick some\r\nserious superhero-style asses!','a what? haha','everything and anything','Movies like Stepmom, A Walk to Remember, and Notebook. Also, when\r\npeople die and when I see others cry over things I can relate to','My best friend and my ipod','Tupac, Pikachu, and Pacino','My mom all the way. ','Irenev1.jpg','Irenev2.jpg'),(20,'Anthony S Cheung. Yes, it\'s a lone \"S\". It\'s supposed to be my\r\nChinese name \"Shen\" (which means \"deep\" as in \"deep water\"), but\r\nofficially it\'s a friggin\' \"S\". ','1st Year\r\nPre-Med Public Health\r\n1st Semester-izzle!','Because I wanted to do something more than act by myself to an\r\naudience of no one in my lonesome life. So many stories to tell,\r\nonly myself to listen. ;_; \r\n\r\nAlso, I\'ve been stalking Theatre Rice for quite the while now. Oh\r\nthose beautiful people. Also, (nonexistent)chicken wings!','Intellectual rumination of the most intense kind. \r\nIntrospection of the most intense kind (self-improvement\r\nregimens, yes!)\r\nPursuing meaningful life goals (including indulging my personal\r\nnarcissistic tendencies)\r\n','Perfectionism and laziness, simultaneously (really makes life\r\nmore interesting at times). ','Meet cool, wow-inducing people. \r\nBecome an \"acktorr\" and gain the skills and experience for\r\nfurther wow-inducing coolness.','Toenails. It\'s fun to pick gunk out of them...and, dare I say,\r\nSNIFF THE AFOREMENTIONED GUNK?!...let\'s leave that to the\r\nimagination. ','REPAIR-MAN...MAN...Man...man...man. He owns things with his\r\nhammer. Kel was a hottie. \r\n','I pick and peel my fingernails under situations of nervousness. ','Stupid stuff like noticing how my AAS professor blinks like crazy\r\nwhen listening to someone\'s question.\r\nHarmless awkward situations (preferably those of other people). ','Laughing way too hard. ','A paper boat and a parachute. It\'s like a morbid sitcom waiting\r\nto happen.','\"That\'s just the way it isss!\"\r\n\"Alpha, Rita\'s escaped! Recruit a team of teenagers with attitude!\"\r\n\"SAY HELLO TO MY LITTLE FRIEND!\"','My parents. Coming to the U.S. as refugees and having jack squat\r\nbut still working their darndest so that I have the privileges\r\nthey didn\'t have...it\'s amazing. ','Anthony1.jpg','Anthony2.jpg'),(21,'David Lee','2010/Public Health???/ First','I\'m Asian and I wanted to learn to act.  ','Movies, Tennis, EATING','I\'m working on it ;)','Fuck my fear!','Eyes because without them we wouldn\'t be able to see things....\r\nthey are amazing...','Mario and Luigi because they provided me with lots of\r\nentertainment while growing up.  :D','Eating.','Ugly people. ','When a small baby deer watches her mother die in a burning forest.  ','Cranium, so I won\'t get bored, and a Pirate ship, so I can leave\r\nthe island with style when I get bored or hungry.','Pokemon cuz I can relate to snorlax.  And pikachu would totally\r\npwn the pink ranger.  :D','My grandma... She\'s the best!','David1.jpg','David2.jpg'),(22,'Jacek Wnuk','Sophomore (Class of 2010, baby!)\r\n\r\nEECS Major\r\n\r\nFirst semester in Theatre Rice.','I joined Theatre Rice because I hadn\'t made a fool of myself on\r\nstage since high school, and I really missed it.  At the same\r\ntime, I wanted to try new things and figure out my strengths and\r\nlimitations as an actor.  But mostly because Theatre Rice is\r\nbasically totally awesome.','Swimming, playing ukulele, programming, being awesome, taking\r\nover the world, breaking and tinkering with things','Acting, I should think, but who knows?  I really love music.  I\r\nstarted playing ukulele around June or July of 2007, so now I\r\nactually play it in addition to listening to it.','I want to learn new things, meet new people, and above all, make\r\nsure that everyone has a good time at shows.  I would like to,\r\nquoth the Scorpions, Rock You Like a Hurricane.','Favorite body part, eh?  Mine or hers?','My favorite would have to be Hiro Nakamura from Heroes.  I mean,\r\nhe can control space and time.  How cool is that?  He\'s the only\r\none in the show that considers his powers to be more gift than\r\ncurse.  I have a pretty busy schedule and I\'m always late, so\r\nteleportation and time-slowing-downage would be quite useful.','I often burst out laughing at seemingly random times.  My mind\r\nhas a habit of going off in tangents and exploring all the random\r\nthings that could happen in whatever setting I\'m in.','Everything and nothing.','Nothing and everything.','A desalination system to provide me with drinkable water and a\r\nwell-made spear to hunt with.  That\'s right, I\'d go for the whole\r\nLord of the Flies experience.  Hyaa!  Kill the pig!','Led Zeppelin, Ninja turtles and Marlon Brando.','My parents, and all that they\'ve done for me so that I could be\r\nwhere I am doing what I love.','Jacek1.jpg','Jacek2.jpg'),(23,'Vanessa Elizabeth Van Zerr','Junior, Integrative Biology, First TR semester (not counting\r\nsummer of rice)','Because it\'s the shiznit.','Figure skating, tortoise massage, playing with devil sticks,\r\nstilt walking, taekwondo (beginner), and snail whispering.','movement...?','I wish to have fun!','Waists.  They\'re pretty on both females and males, and there\'s a\r\nremarkable amount of variation in everyone.  I like looking at\r\nthe shapes.','Rogue from X-Men because she\'s finally a kickass female superhero\r\nwho isn\'t wearing less than her skivvies every hour of the day.','I really like bellybuttons.','A lot of things!  Odd timing, sexual innuendos (i know, i\r\nknow...), inside jokes especially... I seem to always attract\r\nweird people and strange situations no matter where I am and\r\nthinking about them later makes me laugh.','People who try to force others into gender roles and the book\r\nWhere the Red Fern Grows.  I can\'t help it.','The song Kokomo as sung by Kermit the Frog, and a very good swiss\r\narmy knife.','Ummm... what?  I don\'t really care.','John Muir, Link, and maybe Christopher Walken.','Vanessa1.jpg','Vanessa2.jpg'),(24,'Jonathan Amores','3rd year/Major in Mass Communications, Minor in Theater/5th\r\nsemester in TR','i wanted to get involved in theater in college. The end.','you know. watching television and Cirque du Soleil.','making everything awkward.','producing to the max.','probably the anvil, hammer, and stirrup. but those are 3. oh well.','Bob Catman. he\'s the coolest one of all the ones.','CONVICTION ARM.','Arrested Development.','Lost.','my dignity and sense of humor.','none of the above. except for maybe the white ranger. and oddish.','padma lakshmi from top chef.','Jamores1.jpg','Jamores2.jpg'),(25,'Angelito Rivera','Third / Double: Mech Eng and Mat Sci Eng / First','Theatre Rice is an awesome group with a knack for expressing\r\nthemselves intellectually and artistically.','cars, play sports, watch my favorite shows, movie watching','anything to do with my hands like ceramics','I want to see what I find appealing to satisfy my artistic expression','Legs! These limbs can get you anywhere you want...you just need\r\nto realize the motivation to use them.','Major General Jack O\'Neill from Stargate SG-1 because he has the\r\ngreatest sense of humor, great leadership, and a fierce\r\nadversary...so you don\'t want to get on his bad side.','I try to make eye contact with anyone I see as I walk to ... anywhere','facial expressions, moments, and sounds','not cry but close to...when a scene involves a mother dying...I\r\ndon\'t want to lose my mom!','knife and matches','Who\'s Biggie? ... Pokemon ... De Niro','people who stand by their ideals and live with it','Angel1.jpg','Angel2.jpg'),(26,'Jessica \"Sika\" Yang','Junior/ Intended Theater/ 3rd Bowl','I wanted to be with my kind of people... I was a bit awkward at \r\nfirst... but then Jeffffff Chou--a really cool Ricer, mind you-- \r\nhelped me to find the courage to try again.  He Rocks~!','movie watching, yoga-ing, drumming, dancing, bantering... \r\ndating sleep','Acting scripted pieces.\r\nI usually like the dark pieces with a slight crazy flair.','i\'d like to try different types of Theater and also breakdown \r\nstereotypes and presumptions people have about the group \r\nitself.  I want TR to become a force of change for all \r\nidentities.\r\nI also want to make more friends. :)','My Legs.\r\nJust wait... after I work out... you too will know why.','My Grandmother.\r\nShe didn\'t have any problems me.  She loved all of us for the \r\nway we were.  She loved us all unconditionally.','Squealing at a high pitch yo~!','Genuine actors (aka people)','Genuine actors (aka people)','this seems like a psychology/personality question to me.\r\nAnswer: 2 other people.  \r\nWhat does this say about me..? tralala','Kim Ki Duk.  Marion Zimmer Bradley.  Ian McKellen.','there isn\'t a specific person... every small little action or \r\nevent of some sorts has the power to inspire.  Thank you little \r\nactions/events.','Jessicay1.jpg','Jessicay2.jpg'),(27,'CJ Quach','2nd/Cog Sci/1','For fun and personal growth.','Music, video games, killing things','I\'m a musician, I write music for guitar and sometimes my accordion.','A lot! More specifically I want to build my confidence and learn\r\nhow to perform well.','My favorite body part is probably the nipple because it\'s so\r\nuseless and I wonder why I have it. It\'s intriguing.','Batman kicks ass because 1)he\'s got no super powers 2)he used to\r\nbe a ninja.','I hate bugs a lot, they\'re really gross and look like aliens! I\'m\r\nalso very ticklish and when I get tickled it makes me go crazy\r\nand rip shit up!','Funny things, a lot of dry humor, clever things, mostly anything','Being sad or frustrated sucks','A boat and a fishing rod','Tupac because Biggie\'s a puss, power rangers because they can\r\nfunction without needing to listen to some stupid kid, and De\r\nNiro because he\'s got that fatty mole','Musicians and geniuses','CJ1.jpg','CJ2.jpg'),(28,'Janelle','3rd. psychology. 4th','i joined because the shows, the people, the creative process, and\r\nthe community are all super sexy.','seeking adventures. eating dimsum. sleeping in.  good times with\r\ngood people.','the world is my canvas, my loved ones my masterpieces.','i hope to help others grow and find out more about themselves,\r\nand hopefully i do some of that myself along the process.','the tummy.  \r\ncause there\'s a party in my tummy! so yummy! so yummy!','darkwing duck, classic.','i hate feet. \r\nand i chase bubbles.\r\nand i\'m not really sure what an idiosyncrasy is.','crazy times with crazy people. irony. jonathan amores. ','seeing others cry. midterms and finals. jonathan amores.','a comfy bed and someone to sleep in with.','yes to pokemon.  and i had a crush on the green ranger, tommy.','my parents, the hardest working people i know.\r\nanyone who isn\'t afraid to follow their dreams.','Janelle1.jpg','Janelle2.jpg'),(29,'Elita Yin-Hua Wong','II ; intended Public Health (hopefully to combat infectious\r\ndiseases, horrah!); this is semester numero deux in rice. ','The stage, the community, the love.','I enjoy cooking, buying fresh produce, riding my pink bike\r\n(specifically down Channing Way), watering my chia herb garden,\r\ntrying to be thrifty, eating vitamin gummies, playing guitar, and\r\nsinging.','I draw occasionally and love crafty projects.','improv improv improv!','The heart, because it is fragile.','Terry McGinnes from Batman Beyond, because he\'s just so suave. Oh\r\nand Tuxedo Man from Sailormoon (same reason).','I must have tea every day, in any form. I wish we all had a\r\ndesignated tea time so that we could all sip and chit-chat while\r\ngetting our daily dose of anti-oxidants!','I am quite ticklish.','having to travel through highly elevated areas in Berkeley; very\r\nugly, evil things','A sketchbook and Arizona green tea.','Biggie..I like that name; The Mighty Morphin\' Power Rangers, I\r\nthink I still have the pogs!; De Niro (I know, it\'s horrible that\r\nI have not seen the Godfather and that I have seen Meet the Fockers).','My mom, the hard worker, and my dad who fought als for two years. ','Elita1.jpg','Elita2.jpg'),(30,'Kat Mendoza','2nd year/Psychology and Social Welfare/ 2nd semester in TR','I enjoy attention.','pop culture lover. concert goer. movie watcher. music listener. \r\nliterature reader.','Whatever you\'re into..;)','I hope to expand my range as an actor and social skills as an \r\nawkward human being.','I wish people could just look at me from the back. Those are \r\nreally my best features out there. Smmoth back, big bootay, \r\nmuscular calves...when you look the other way you get small \r\nboobs, belly fat, and gapped teeth. Other than that my beautiful \r\nsmiling face.=)','superman. he has it all--and i want to fly some day. oh and \r\npeter petrelli bc he is jess mariano.<333','loud sudden noises tend to scare me more than an ordinary human \r\nbeing. so i cringe my face when i put away dishes because of the \r\nsound the plates make when they hit together. same with the bang \r\nafter the pretty lights of hte fireworks.','the awkwadness of life. the misery of others. chandler bing. and \r\nyou.','im a cry baby: movies, books, stress, happiness, you name--i \r\nprobably cried to it.','a genie and my mom.','tupac. tie. deniro.\r\n\r\n\r\n...whew! those were toughies.','i tend to take inspiration from all parts of my life. movies, \r\nbooks, other actors, friends, and most of all family. My mom and \r\nGod are pretty high up on the list for inspiration<3','Kat1.jpg','Kat2.jpg'),(31,'Ahema \'H-ma\' Adarkwa','Year: Year of the Pig ( Still an Undergrad.though.. not graduated\r\nyet...) \r\n\r\nMajor: Architecture.. I not used to sleep anymore\r\n\r\nSemesters: 2 full ones... this is my third...','Steve La, told me that I should join this group called Theatre\r\nRice.. I said i\'m no actor.. and he said it\'s fun and that he was\r\ngoing to the meeting and we will have sooo much fun.  Then I\r\nsigned up and Steve joined Jericho..what\'s up with them stealing\r\nour ricers..\r\n\r\nAnyway, theatre Rice is family..  that\'s why I keep coming back!','Bellydance, Guitar, Piano, Eating','I want a fort! ','I want to learn how to be a better\r\nactor/director/writer/singer/songwriter. \r\nAlso I want to learn if there are any more slashes I can put in\r\nmy abilties.../dancer/student/woman/your homie/lover/friend','Neck.. because it holds up your head..? Necks are sexy.','Hiro on HEROES! omg i love that show!!  He is so optimistic and\r\nhopefull that you can do it! So open and not egotistical like\r\nother superheros. Ya ta!\r\n\r\n','- One of my ears is pointy, like Spock. guess which ear..\r\n\r\n-I make random songs up, like.. when I\'m walking down the\r\nstreet.. I might start singing.. \'walking down the street,\r\nwaaaalking down the street. oh oh oooh','Improv, anything that comes out of  ernesto or shawn jain\'s\r\nmouth,  other sayings and doings of Ricers. :-()','neglect, hatred, ignorance','Theatre Rice Cast. \r\n\r\nRed Wine','Both. no. yes','People who strive make it in a world that tells them they cannot\r\nmake it.\r\n\r\nZora Neale Hurston\r\n\r\nNina Simone\r\n\r\nSung Kang (my future husband) \r\n\r\nYul Kwon ','Ahema1.jpg','Ahema2.jpg'),(32,'Suvachai Sonny Watanasirisuk','Year: I lost count, and it\'s complicated.\r\nMajors: Mechanical Engineering / Business Management Economics\r\nSemesters in TR!: 5th, counting this one.','I joined mainly to continue what I\'ve been doing for \"Rainbow\r\nTheatre\" at UC Santa Cruz, representing minorities in the media\r\nand help tell the stories that wouldn\'t be told otherwise.  The\r\nbonus was that I love attention and show that I am an interesting\r\ncharacter on- and off-stage.\r\n\r\nBut why I keep coming back to TR! is a different story.  The\r\natmosphere, meeting people, the creative process, the trust; all\r\nof which is what keeps me here and going in life.','Cars/driving, drawing, writing, bowling, dining.','Singing and playing the tuba.  A combined experience of 19 years\r\nhas to say something.  And also, I can draw/paint landscapes well\r\nfor some reason.','This is my last semester in TR! as a student, and possibly\r\nforever.  I don\'t know where my future will take me, but I want\r\nto leave knowing I made a difference in the history of this group\r\nby making tech easier for people to learn/setup.\r\n\r\nSecondly, get on stage.  It\'s been at least a year since I was\r\non-stage for an official TR! show.  I want to leave TR! as I came\r\nin: an actor.','My head.  It\'s tough as hell!  It\'s weird.  I\'ve gotten hit hard\r\nin the head too many times to know that it\'s difficult to knock\r\nme out with a blow to the head.','I don\'t know since I never figured out the appeal of superheroes,\r\nto be frank.','Being able to debate about and theorize the physics of time\r\ntravel, regardless of whether it exists or not.','Very geeky inside jokes.  Also, seeing drivers weave in-and-out\r\nof traffic to save time, only to see me putting along side after\r\nall of their efforts.','When I see sports cars that aren\'t used for its purpose and\r\nbecome showcars, i.e. static eye-candy to car enthusiasts.','A fully-fueled helicopter and a pilot.  Screw the island, I like\r\ncivilization.','I don\'t care much for rap.\r\n\r\nPower Rangers and Pokemon got too complicated as both series\r\nprogressed in time.\r\n\r\nAlso, I never watched \"Goodfellas\" or \"The Godfather.\"   ','My parents, definitely.  They both embody, essentially, the\r\n\"American Dream.\"  Immigrating to the U.S., working hard and long\r\nto start a family, raising kids to succeed in life and make them\r\nhappy, and retiring with wealth to spare to enjoy what the world\r\nhas to offer.','Sonny1.jpg','Sonny2.jpg'),(33,'Joy Regullano','freshman/undecided/first semester in TR','I love being on stage and being someone else, even if it\'s just\r\nfor a little bit, and I\'ve wanted to do theatre for a long time','writing bad poetry, worrying about my future, dreaming, watching\r\ncartoons','er... being quirky and random','I want to get better at Improv and making things up out of nothing!','My glasses, because everything I am is wrapped up inside of them','Spider-man, because he\'s so smart and nerdy and in love','I\'m small, and I like it!','The Office, Arrested Development, and Danny Phantom','unrequited love!... and my broken glasses','a book of E. E. Cummings and a soulmate','Pokemon hands down! I stopped keeping up after Johto though...\r\nThe original Pokemon are the best! ','Many people, but often characters in books','Joy1.jpg','Joy2.jpg'),(34,'Allen Chang','Senior, Mechanical Engineer, 6.5 Semesters ','Mainly because Julius gave me a ride home during Christmas break\r\nmy sophomore year','UC MAP, MVC2, movies, working out, and STARRR TREEEEK','saying the word \"boring\" in the most valley-girl like fashion\r\nknown to man','leave a good impression of TR with those I direct, become close\r\nto those who I interact with, and have fun in general. ','not too sure... my least favorite body part are my ankles, cuz\r\nthey\'ve been sprained like 10 times each','Superman. it\'s amazing how reverent he is to not killing, and his\r\nphilosophy is also that of compassion in a passive and not\r\ncontrolling manner; all of which are exceedingly difficult taken\r\ninto context of his seemingly endless power.  ','I commonly mistake the name \"Brian\" for \"Daniel\"\r\nMy ears also sometimes turn red individually ','Thomas and Juan in a scene togeather','Onions do the trick','a five star hotel\r\n\r\nand a pocket knife','Tupac, De Niro, and POWERPOKEMON!!!','not too sure','Allen C1.jpg','Allen C2.jpg'),(35,'Christy Yang AKA Yangsta!~','Year: 2010\r\nMajor: slaving in pre-med and hopefully going into molecular\r\ntoxicology or nutri. sci \r\nSemesters in Rice: First one :)','I love the energy that they exhume and wanted to be a part of\r\nsomething so crzy~','Singing, dancing, waving at random strangers and smiling when\r\nthey wave back...watching the Office and Brothers and Sisters,\r\nchallenging my creativity ','Get to know me and you\'ll see :)','Develop myself and explore more creative paradigms....have LOADS\r\nof fun making a fool out of myself :P','Some moments its the eyes...for almost cliche reasons (but true),\r\nsome moments the lips...but mostly a person\'s hands. I love the\r\nsymbolism behind them, and their ability of touch.','Hahah so here\'s my progression: \r\n\r\nEarly years...Power Rangers\r\nElementary school...Animorphs\r\nMiddle school to college....not impressed :P','I love the feel of silk rubbing against each other...i have NO\r\nidea why. \r\n\r\n','PIXAR MOVIES!!!\r\nKids and their wild imaginations\r\nThe Office :D\r\n','','I could be logical about this... I\'d say I have to bring a watch\r\nto keep track of time because without it you go insane, and the\r\nguy from Man vs. Wild.\r\n\r\nBUT....I\'d totally be happy with a partner in crime instead','Dunno. Pokemon. Pacino. ','Different facets of people I am influenced by. I take what I like\r\nfrom the people I see...but if I had to narrow it all down to one\r\nperson...strangely it\'d be Angelina Jolie. ','Christy1.jpg','Christy2.jpg'),(36,'Thomas Tan','Junior, Society and Environment, 5th Semester Ricer','\'Cuz, like, you guys are, like, totally fabulous!','Staying alive.','Comickry, Practical Violence','Improve my directing and acting abilities','My hands, cuz I can hit people with them.','Spider-man, cuz he\'s a normal guy who HAPPENS to be a superhero.','I say \"Ya know...\" a lot.','Everything.','Nothing.','Satellite phone and an egg-laying hen.','2pac, Pokemon, Pacino.','Strong people.','Thomas1.jpg','Thomas2.jpg'),(37,'William Wang','Super-ior senior! 3rd semester.','For the energy exploding off of the stage.','Eating, and thinking about how it\'s made, and trying to make it,\r\nand eating it again.','Plating food. Tasting color.','This semester, Theatre Rice is going on the road to so-cal!\r\nTheatre Rice: Road tour! Woot.','Hands, because they can create... but also deStRoY!','Right now I really like Batman. Maybe because the movies don\'t\r\nsuck anymore.','I\'ve been told I over-enunciate the letter \"P.\" Whereas most\r\npeople say Troop, I will say, Tr-oo-puh.','Babies flying in the air.','Babies launched into the sky preceding the flying. I\'d be crying\r\nfrom laughter.','Samurai sword... and... The Human Torch (as my cook).','Pokemon. That\'s all I need.','You!','Will1.jpg','Will2.jpg'),(38,'Angela Ren','2/Bioengineering/3','A gravitational force','exploration','imagining','have fun, make friends, push self, think creatively','the mind. because it\'s amazing how everything and anything can\r\nstem from there.','batman','i doodle a lot of circles and squares for no reason.','people','people','a knife and a friend','power rangers. that\'s the only answer i have','anyone with a passion','Angela1.jpg','Angela2.jpg'),(39,'Simon Shen','2nd Year, 3rd Semester in Rice, Economics','To ensure that I have no free time and no sleep for the rest of\r\nthe semester.','Refer to the question #3. Hobbies require free time. ','Anything that doesn\'t involve drawing, art, or hand-eye\r\ncoordination. ','Oh... so many things. ','I have a hair on my toe that I really like.','Bananas in Pajamas.','I am currently eating a burrito. It is filled with meat, beans,\r\nand rice. It is wrapped in tin foil. ','Any joke that I am not the subject of.','When I get my midterms back.','A handle of whiskey and a cell phone.  ','Tupac, Pokemon, Both.','Beauty.','Simon1.jpg','Simon2.jpg'),(40,'Apurv Gaurav','2009\r\nMolecular Cell Biology\r\nSouth Asian Studies\r\nIt\'s my first time here in Theatre Rice!','I always wanted to do something where I can experiment stretching\r\nmy personality and taking on new roles, as this really prepares\r\nyou for life. If you think about it, life is basically one long\r\nplay. If we treat the problems that we encounter everyday as\r\nevents in a play, it will not hurt us personally and we will be a\r\nlot happier. By becoming an actor we develop the capability to\r\nstep back from the emotional and turbulent entangles of life and\r\nsimply observe the bigger picture.','Reading, maps, and learning about the world. I can name most of\r\nthe capitals of the world! Conversing with people.','Playing sitar','I want to learn how to project my voice naturally, in the\r\nappropriate situations.','What I have between my legs. It serves an important biological\r\nfunction.\r\n\r\n(jk)','I would go with Spiderman because spiders are just that cool!','I am always running late to things.','Thinking about life...about my problems...about people. Mistakes\r\nI do on a daily basis.\r\nAny kind of humor, whether it\'s stupid, witty, obscene.\r\nI always appreciate a good laugh','When I see innocent people suffer. Broken families','The World Wide Web and my family. ','2pac, Pokemon, Al Pacino','My little brother inspires me the most. I feel that as an older\r\nbother, ten years older than him, I must be the greatest that I\r\ncan be I am a role model for him. As he tries hard in his own\r\nlife, it inspires me to continue excelling in whatever I excel at. ','Apurv1.jpg','Apurv2.jpg');
