INSERT INTO `Fall_2006_Cast_profiles` VALUES (1,'Ahema Adarkwa','last semester','2','architecture','yo mamma','yo mamma','i like to laugh, i like to run, i like to have lots of fun, i\r\nlike the sun, i like bon bons, but i really like beets.\r\n I hate those that are dumb, and downright scum, I hate licorice\r\ngum, I hate those glow-in-the-dark condoms. \r\n  i love rice, and everything nice, i love that show the price is\r\nright. i love.. yo mamma ','yo mamma','yo mamma,\r\n\r\nno seriously um hug my friends. \r\n','Being eaten by a Tyrannosaurus Rex, named Rex. ','i want facebook to die. hate facebook now. boo facebook. takes\r\nthe fun out of stalking people. an the birthdays are all off to\r\nthe side now. I can\'t see when everyones birthday is. and what is\r\nup with make facebook for everyone. i\'m no socialist. ','Homer Simpson. one..  homer has been on the tv longer. since i\r\nwas 5.. om man i\'m dating myself. some of you weren\'t even born\r\nyet.. weird.  two. Homer... i think he has this epic poem thing\r\ntoo. that\'s way better.  ','wine.. spanish wine','yo mamma, \r\nshe knows how to work it. ','Ahema Adarkwa1.jpg|Ahema Adarkwa2.jpg|Ahema Adarkwa3.jpg|Ahema Adarkwa4.jpg|'),(2,'Brian Schroer','3rd year transfer student','First year!','Anthropology','To finally try out some theatre and to leave my comfort zone.','To learn how to organize, write, and even direct basic sketches.','I am cool. And very handsome. You should get to know me.','Camping somewhere in the wilderness. Drinking beer with friends\r\naround a fire.','Go to Canada','Sleeping.','Don\'t like them, though at least you have the option to take them\r\noff.','Homer all the way, are you kidding me?','too many to list. I like Indian, Japanese, Italian, everything\r\nbasically!','Some of my friends. They have some great qualities.','Brian Schroer1.jpg|Brian Schroer2.jpg|Brian Schroer3.jpg|Brian Schroer4.jpg|'),(3,'Helen Tran','Junior','First','Public Health and Chinese Studies','Because Theatre Rice is full of amazingly funny people','I hope to gain a better understanding of who I am and what are \r\nsome of my limits.','I\'ll believe or semi-believe anything you say if you can say it \r\nwas seriousness and a straight face.','Not having to do homework or study for a test. Also, feel \r\nguiltless about not doing homework or studying for a test.','Eat a lot of stuff with all of my friends and family','To died in one\'s sleep','Facebook mini-feeds equals facebook stalkers best friend','Homer Simpson','Rocky road ice cream','Someone who goes out there and make a difference instead of \r\ntalking about it all the time.','Helen Tran1.jpg|Helen Tran2.jpg|Helen Tran3.jpg|Helen Tran4.jpg|'),(4,'Kevin Hamano','2nd','1st!','PSASAMS (otherwise known as Political Science and Asian American\r\nStudies)','Because I\'ve always wanted to do theatre and rice is always nice','In a fortune cookie (because nuts are gross), I hope to learn how\r\nto act better','I\'m like one of those assortments of hard candy; you never know\r\nwhat youre going to get next. At one sitting you might get\r\nstrawberry and at another a pineapple, but when it comes down to\r\nit, Im almost always likeable','Chilling out with friends or watching the sunset from the Big C\r\nwith someone I <3','Because I could never see me becoming Mayor of Los Angeles, nor\r\ncould I learn how to wake board so quickly, I would spend my time\r\nmaking my family and friends happy','Seppuku or in one\'s sleep','I HATE them.  They\'re tools for the unfit stalker.  I mean\r\nreally, do I care to know that Anthony and Linda hooked up?!\r\n(nervous laughter)','Que?','Anything but curry please','People who do so much, are so charismatic, and who just make you\r\npause and go \"wowwww.\"','Kevin Hamano1.jpg|Kevin Hamano2.jpg|Kevin Hamano3.jpg|Kevin Hamano4.jpg|'),(6,'Linda ','I am a senior citizen.','Deuce.','I am currently studying Mass Communications and minoring in \r\nAwesomeness.','I was looking for an on-campus club that rules in all sectors \r\nof the world... including Middle Earth. I also wanted to gain \r\nsome theatre experience... ','More theatre experience. Not puking before I go on stage. I \r\nalso need to stop laughing when I\'m on stage. I dont want to be \r\na Jimmy Fallon. Jimmy Fallon sucks big balls. ','Prince (born Prince Rogers Nelson on June 7, 1958; Mount Sinai \r\nHospital), known as  (or informally, The Artist Formerly Known \r\nas Prince) from 1993 to 2000, is a popular and influential \r\nAmerican musician. His music has spanned myriad styles; though \r\nhis early material was firmly rooted in R&B, funk and soul, he \r\nhas constantly expanded his musical palette throughout his \r\ncareer, absorbing many other genres including new wave, pop, \r\nrock, blues, jazz and hip-hop. ','My ideal Friday night would be having a beer with my friends \r\nand eating some delicious food. Then we\'d probably watch an \r\nawesome movie at home while someone is baking the most \r\ndelicious batch of chocolate chip cookies. ','Realistically, I would probably cry. Then I would snap out of \r\nit and try to gather everyone I care about and get them in one \r\nplace. Then I would hug everyone and have a goodbye party. Then \r\nI would have sex with my partner for 8 hours, or until I die. \r\nHopefully I would die being hugged. That would be nice. ','I guess I would like to fall asleep while I have my partner \r\nhugging me. Maybe I\'ll have the taste of chocolate chip cookies \r\nin my mouth... or an actual chocolate chip cookie in my mouth.','Dude you just made me so depressed Anthony (webmaster).. this \r\nquestionaire sucks balls. Fuck this number 11 question.','Homer. If you say Peter Griffin, meet me in the quad under the \r\ncherry tree and I\'ll prove you wrong. ','In & Out cheeseburger with grilled onions. Fried calamari from \r\nThaifoon. Fresh chocolate chip cookies. Whiskey.','My parents, brother, bestfriend and my partner. They all have \r\ndifferent qualities that I highly admire. Theatre Rice members \r\nhave all inspired me to be a better person in one way or \r\nanother. ','Linda 1.jpg|Linda 2.jpg|Linda 3.jpg|Linda 4.jpg|'),(7,'Jeff Chou','4th','3rd','EECS','To embellish my dreams as a cardboard prop.','Hopefully i will learn how to graduate.','i\'m a coffee cup mug filled with ice cream and sprinkles.','NOT doing homework.','Eat like the crazies.','Through a wormhole that tears my body asunder into 80 million\r\npieces so i can be pooped out in another dimension and be\r\nmistaken for gold.','They were annoying and intrusive at first... but now i\'m finding\r\nout about all the stuff everyone\'s doing, and well.. i don\'t\r\nreally care what everyone is doing.. so now it\'s just annoying.','Homer, cuz he\'s the original G.','Asian food, yea-yerz!','I admire this guy in alabama named Billjoe. ','Jeff Chou1.jpg|Jeff Chou2.jpg|Jeff Chou3.jpg|Jeff Chou4.jpg|'),(8,'Thomas Tan','Second','Third and running!','Environmental Sciences','There\'s theater, then there\'s rice; two great tastes!','I hope to gain some dramatic acting skills, and possibly some\r\nexperience in directing.','About five foot four, likes long walks on the beach, flowing head\r\nof hair... :)','Home, wrapped in either a warm blanket or a warm girl.','I\'d let everyone know that I cared about them, and that they\r\nshouldn\'t worry about me.','Asleep peacefully, like my grandpa, not screaming like the people\r\nin his car.','They\'re pretty cool, I guess.','Homer Simpson, hands down. Dude was the Hulk for a little bit.','Vietnamese Noodle Soup, aka \"Pho\"','Probably David Belle, co-founder of parkour, who rises to meet\r\nevery challenge with energy and determination.','Thomas Tan1.jpg|Thomas Tan2.jpg|Thomas Tan3.jpg|Thomas Tan4.jpg|'),(9,'melody liao','freshmen','0','public health, poly sci, p.e.i.s...perhaps punjabi','theatre rice is the place to be.','how to get on my dancing shoes','i\'m stone cold steve austin','watching reruns of project runway while sipping on sake and juice','force johnny depp to make out with me','swallowing a vial of poison while taking a bubble bath','love the mini-feeds. they release the inner stalker in me','hands down. peter griffin.','thai food, eggplant, and almond tofu','jesus christ, cuz he\'s the man.','melody liao1.jpg|melody liao2.jpg|melody liao3.jpg|melody liao4.jpg|'),(10,'Andrew Chung OR Duma Nes','2nd','1','Intended Business','I wanted to be surrounded by fellow Asian-American artists. And a\r\nprogram like this is rare.','Learn more about acting and expressing myself. I want to push\r\nmyself to my artistic limitations.','I\'m super chill. Don\'t be afraid to tell me how your life is, cuz\r\nI like listening. I\'m a film conissieur. I\'m a rap phenomenon. I\r\nlike nature. ','Going on unexpected adventures with friends.','Too rated R for people to know. But some verbs include killing,\r\nstealing, and sleeping with...','My history teacher told me this: Go up the Andes Mountians and\r\nget wasted. And while you\'re sleeping away, you\'ll slowly freeze\r\nto death, but you\'ll feel warm and fuzzy inside. ','Good for stalkers, bad for everyone else.','Homer, just cuz he\'s the OG cartoon dad.','Something that goes well with hot sauce. ','My dad cuz he\'s the man. My sis cuz she\'s the nicest person ever. ','Andrew Chung OR Duma Nes1.jpg|Andrew Chung OR Duma Nes2.jpg|Andrew Chung OR Duma Nes3.jpg|Andrew Chung OR Duma Nes4.jpg|'),(11,'Lisa Lee','4.5','4? 5?','Theatre and Performance Studies & Mass Communications','The question is not why, the question is why not? ','I hope to marry Jade the Law sometimes in the near future and\r\nhave babies with her. Actually, I take that back, we\'ll have two\r\nawesome kids named \"Comedy\" and \"Troupe\" by the time December\r\nrolls around. Seriously? I hope I will be remembered as someone\r\nthat helped someone to change his/her life. I hope to continue to\r\nshape Theatre Rice, together with all its members past and\r\npresent, into something that is brilliant, engaging, and\r\nrelevant. It should be something that people are proud of.','I am a workaholic who doesn\'t want to admit it. I enjoy the\r\nsimple pleasures in life, such as waking up really early in the\r\nmorning and rolling around all day (or at least a couple of\r\nhours) in bed. I like watching movies over and over again, the\r\nones that I like of course. I love good conversations with\r\npeople. I\'m family-oriented. I love holing up with people that I\r\nlove and do nothing but watch variety shows. I hate Starbucks but\r\nI love its Green Tea Latte with Soy. According to my friends, I\r\nhave will power because I deleted my Myspace account. I want to\r\ngo to law school but I really don\'t. I want to have my own\r\ntheatre company one day. I like knowing what I want. Actually, I\r\nlove the ability to want. I am a wanderer, but I don\'t think I\r\nwas ever meant to be one.  ','Friday night?  What is that?','I would spend today with my family. If I am selfish, I would fly\r\nmyself to New York, break into a really rich person\'s Manhatten\r\napartment, and pretend like I live there. ','Sleeping pills... yeah... definitely sleeping pills... a lot of\r\nsleeping pills? I would like to die peacefully, and without doing\r\nanything destructive to my body.','I hate them. I feel like I am reading U.S. Weekly everytime I\r\nlook at the mini-feed on my profile. I start twitching and then I\r\nhave to quickly click on something, anything, in order to feel\r\nlike I am not invading someone\'s privacy. ','Homer?','Thai food! Fish burritos! Chicken lasagna! As long as I am not\r\nhungry, all kinds of food are my best friends. Yum. ','Brandi Catanese. She\'s one of the best professors you\'ll ever\r\nhave here on the Berkeley campus. She even has a facebook fan\r\ngroup (not created by me of course)! I won\'t say anymore because\r\nif one day, she finds this online, she\'s going to think that I am\r\nstalking her, when I am really not. She\'s just an amazing person.\r\nShe\'ll open your eyes to things that you have never seen before.','Lisa Lee1.jpg|Lisa Lee2.jpg|Lisa Lee3.jpg|Lisa Lee4.jpg|'),(12,'Juan-Miguel N. de Joya','Junior','One','eCoNoMiCs','For world peace~&#9829;','Better confidence and ability to express oneself creatively, as \r\nwell as make new friends on the stage and off it. Also, 4 l33t \r\nhaxxored sk33lz w00t pwnd.','Simple and complex; a long story with no ending in sight; \r\ncarrying a sugar-sweetened sadness with a smile on my face and \r\na hole in my heart; a lover, a fighter, an imaginaut; never say \r\ndie, never give up; recollecting, regretting, formerly angry, \r\nformerly lost, now found and redeeming what was wasteda \r\npassion so strong that it could give the world the one thing I \r\ncan never give myself  love.','Being with someone I care for, whether its just sitting on a \r\ncouch cuddling or driving away to some far-off romantic spot. \r\nIm a sentimental sap, and I cant get over the whole idea of \r\nit, so there.','Die another day. Because tomorrow never dies.','Holding onto/held in the arms of someone I care for.','Gods gift to vicarious living. ','Jabba the Hutt.','I feast on the sorrows of the human condition. Also, sashimi.','My best friend Edgar Real, because he reminds me of who I \r\nshould be and what I can be as a person. He also drives me nuts.','Juan-Miguel N. de Joya1.jpg|Juan-Miguel N. de Joya2.jpg|Juan-Miguel N. de Joya3.jpg|Juan-Miguel N. de Joya4.jpg|'),(13,'Nick Wong','Stunna Shade Super Senior (4.5)','One on cast, one on committee, and one as a stalker. So about eight.','Nutritional Science. With a minor in Being Ridiculous.','I joined because Rice was a way for me to get away from things\r\nthat I was comfortable with, and to help me grow.\r\n\r\nAnd because I\'m secretly an attention whore. Well I guess it\'s\r\nnot really a secret anymore.','I hope to scare the crap out of myself by doing improv, meet new\r\nfriends, gain telekinesis, and learn how to hotwire a car.','M/22/Berkeley/Huge\r\nPic?','Cooking, eating, drinking. Then eating again. Sometimes I like to\r\ndo this with other people too.','Streak. Rob a bank. Streak while robbing a bank. Bet someone that\r\nif I die tomorrow, they have to streak at my funeral. Get into a\r\nfight. Make vague predictions of the future, the last of which\r\nwill be foretelling my own death. That way, people will think I\'m\r\nprophetic and interpret my words to fit their futures. Pee on R.\r\nKelly. Go to Vegas and bet $1,000,000 on 00, then leave.','Without regrets.','Meh. They were annoying at first, but now it\'s just extra minutes\r\nof procrastination for me. By minutes, I mean hours.','Homer Simpson. Because if Peter were to do anything, it wouldn\'t\r\never happen. It\'d just cut away to a random funny scene about pop\r\nculture that\'s totally out of place. During that time, Homer\r\nwould get drunk off Duff and crush him. Sweet.','That\'s like asking what my favorite letter is. How do you choose?\r\nThey\'re all so good and special in their own way. Except for the\r\nletter X. X is too much of a hipster. I bet X has a blog about\r\nhow painfully tragic it is to be an X.','People that know what they want, are passionate about it, and go\r\nfor it. Life is too short to keep thinking about the what-ifs. GBGH.\r\n\r\nAnd Jessica Simpson.','Nick Wong1.jpg|Nick Wong2.jpg|Nick Wong3.jpg|Nick Wong4.jpg|'),(14,'STEPHEN SEBASTIAN KON-CHIANG CHANG','4TH','1','IB','WE ARE THE EPITOME OF AN OVERLAPPING SEGMENT IN A VENN DIAGRAM \r\nOF ARTISTS AND ASIAN AMERICANS.  NOTHING LIKE IT.','SIFT THROUGH MANY LAYERS OF VOICES, SO I CAN FINALLY LISTEN TO \r\nMYSELF SPEAK...AND TO REMEMBER WHAT THAT SOUNDS LIKE.','A FALLEN MUSICIAN.','ANYTHING WITH SOMEONE I LOVE.','LOOK THROUGH OLD PHOTOS.','WITHOUT KNOWING.','&#1041;&#1051;&#1040;&#1043;&#1054;&#1057;&#1051;&#1054;&#1042;&#1048;&#1058;&#1045; &#1042;&#1040;&#1057;','TYRANNOSAURUS REX, OF COURSE!!!!','GRAPES','MY COUSIN, MELODY.  THE DEEPEST, MOST PHILOSOPHICAL PERSON I \r\nKNOW.  SHE HAS CHANGED MY LIFE...ALTHOUGH WE TALK IN BROKEN \r\nCHINESE/ENGLISH, WE UNDERSTAND EACH OTHER BETTER THAN ANYONE I \r\nHAVE EVER MET.','STEPHEN SEBASTIAN KON-CHIANG CHANG1.jpg|STEPHEN SEBASTIAN KON-CHIANG CHANG2.jpg|STEPHEN SEBASTIAN KON-CHIANG CHANG3.jpg|STEPHEN SEBASTIAN KON-CHIANG CHANG4.jpg|'),(15,'Philip Liou','Junior ','3rd and counting','Economics ','To be with more Asian people and be an \'actor.\'','To develop a plethora of new characters for myself, some\r\nleadership skills, and lots of money. ','See facebook profile. ','Busy day, even busier night. Teeheehee.','Change my facebook status to \"Dead,\" post my will on xanga, and\r\ndo dangerous, exciting things today until I die. So I know I died\r\nhappy. ','Unexpectedly and while doing something fun.','Outrageous.','Peter Griffin. He is much fatter and more stupid. ','Sashimi salad. ','Tiger Woods. He\'s got everything, but strives for more. ','Philip Liou1.jpg|Philip Liou2.jpg|Philip Liou3.jpg|Philip Liou4.jpg|'),(16,'Jonathan \"J\'Amores\" Amores','2nd Year - 2009','3rd Semester','Mass Communications/Minor in Theater','to do theater and participate in the Asian American community at Cal.','probably confidence in my leadership skills.','well, I\'m pretty awkward...that\'s about it. i also watch way too\r\nmuch tv.','Cirque. du. Soleil.','not panic.','falling off a log...because it\'s easy...?','i say to heck with them! but really, they\'re not so bad.','unfortunately, I don\'t watch Family Guy or The Simpsons. I\'d\r\nrather see GOB Bluth vs. Dwight Schrute. now that\'d be interesting.','swedish fish. most def.','my parents. because.','Jonathan Amores1.jpg|Jonathan Amores2.jpg|Jonathan Amores3.jpg|Jonathan Amores4.jpg|'),(17,'William Wang','4th','First timer.','Architecture and Art','To be surrounded by people who are f\'ing beautiful... on the \r\ninside.','Friends, Lovers, and Enemies. Scratch the last two. one.','I\'m trying to live life one day at a time.','Wake up from my long nap and get ready to go out... and by out \r\nI mean play karaoke revolution.','Eat all the things I haven\'t tried yet.','Being massaged to death.','It makes me \"feel\" like a stalker. Mua. Ha. Ha.','Homer alone has an array of skills. Homer with Snake\'s \r\nscalp, \"I am evil Homer\" Homer, 400 lb Homer. Basically Homer \r\nwins hands down in any battle.','Danish open faced sandwich made with a thick slice of freshly \r\nbaked wheat bread, moistened with creamy butter, layered with \r\nleafy greens, sprouts, two fillets of fried cod smothered in \r\ntartar sauce, topped with a slice of lemon served cold... OH \r\nyea...','Ash Ketchum. Each day he wants to catch them all, and be the \r\nvery best that no one ever was.','William Wang1.jpg|William Wang2.jpg|William Wang3.jpg|William Wang4.jpg|'),(18,'Jina Youn [fob name: Soojin]','Freshman','1','MCB (Pre-Med)','I can\'t live without rice in my life. I\'m only Asian!!\r\nBut otherwise, because acting is one of my passions and I \r\nbecome a different person in front of an audience.. \r\nliterally. :]','I hope to explore myself and stretch unused parts of my mind \r\n(and body.. \"lion! lemon!\") to discover hidden talents and \r\nstrange tidbits about myself.','I love to sing, dance crazily when I\'m alone in a room, play \r\nthe piano and write cheezy songs, play volleyball and \r\nbadminton, go horseback riding and white-water rafting, gawk at \r\nlittle furballs of bouncy delight, try ethnic foods, smell \r\ncoffee and oranges, and watch the sun watercolor the skies as \r\nit sets.','Have dinner at a nice restaurant, watch a good movie, stargaze \r\nwith a cup of coffee, and indulge in music in any way, but \r\ndoing all with friends.','I would bunjee jump and hang glide, go to a concert, fly to New \r\nZealand, tell everyone I love that I love them, and float out \r\ninto the sea with dolphins, singing my last song.','Right after I do something that I love or have always wanted to \r\ndo.','Just perfect for my daily stalking sessions... >:]\r\nExcept, I\'m not a stalker... :/ oh well...','Homer Simpson... because he has 2 strands of hair on top of his \r\nhead... that is so sexy.','Rice... and everything else :]','I admire all those who can accept their life and enjoy it, \r\nbecause those are the people who can actually make something of \r\nthis world.','Jina Youn [fob name_ Soojin]1.jpg|Jina Youn [fob name_ Soojin]2.jpg|Jina Youn [fob name_ Soojin]3.jpg|Jina Youn [fob name_ Soojin]4.jpg|'),(19,'Jessica Yang','1987','this is my first time.','at the current moment...... theater.... but whatever','i wanted to prance and frolic with those who also need to explore acting and \r\nimproving.','to learn to submerge myself into and be one with the rushing waterfalls of creative \r\njuices that spur on great acting/improving','i\'m mainly short, but don\'t let that fool you... i like to laugh and giggle out loud.  ','anything with friends are nice.  but if alone, i like to watch several movies and read a \r\ngood book cozied up in my bed, yum~!','go out with a sizzlin guy...multiple sizzlin guys.... switching every 2 hours.... ','in the arms of my lover','why....why?!','i don\'t know who peter griffin is, but peter griffin will win','bimbimbab mmmm especially in the end with the noorungjee (without the water).... i \r\nwant some right now.....','normal people who stick it out to continue living, no matter the struggle to become \r\nwhat they want to become while not forgetting others. kudos kudos!','Jessica Yang1.jpg|Jessica Yang2.jpg|Jessica Yang3.jpg|Jessica Yang4.jpg|'),(20,'jade law','3rd year! yeah!','6.5','japanese/english','an old pack of ricers approached me on the street and handed me a\r\nmewling brown paper bag. inside was the cutest little kitten\r\never! it was black with white socks. the gang and i nodded to\r\neach other. the exchange was made. i joined.','directatorship is one for all, all for one!','Within the context of Theatre Rice: imagine a bumpy, funky\r\nlooking rock. someone knocks it off the street and onto a patch\r\nof dry grass. rainfall buries the rock within the soil. little\r\nearthworms inch tunnels underground, aerating the soil. suddenly\r\na cute little sprout pops outta nowhere, and zooms upwards to\r\nslowly culminate in a cute little bud with potential for infinite\r\ngrowth. \r\n\r\ni am one of those earthworms.\r\n\r\nin the real world, i actually despise worms.','one never the same','Kill my credit by withdrawing as much money as possible--try to\r\nfly me and my Significant Ones to a tropical beach somewhere.\r\nwe\'d fly in style and on the flight, remember all those great\r\ngreat moments. i\'d excuse myself for a few hours, write letters\r\nand a manifesto of my recent life, of being told i would die\r\ntomorrow and what it\'s actually like. i\'d mail my letters on\r\nlanding, have a great last meal with the people i love, and then\r\nwe\'d all lie in the warm sand under the stars and together,\r\nimagine in detail the life i would have had if i\'d lived. as my\r\nvision begins to waver, from either tears or hell, i\'d smile back\r\nand tell them to cremate my body and wear my ashes in a little\r\nlocket forever. i\'d close my eyes...pop them open and say juuust\r\nkidding guys. just have a bbq with my ashes instead.','with my husband of 62 years by my side, holding hands while all\r\nmy kids and grandkids and great-grandkids bawl in a big circle.\r\ni\'d tell them all to quit crying because grandma\'s gonna crazy it\r\nup in the afterlife...now go get me some pudding','at first they were creepy, but now i wish i could block some\r\nfriends\' information from showing up. i really don\'t care to know\r\neverytime you added a friend or left a club y\'all.','homer simpson is immortal. ','hypothetically, i\'m thinking a loud family dinner with raucous\r\nyelling and my sisters\' boyfriends and my boyfriend, and my\r\nbrother\'s girlfriend which we tease him about to no end. we tell\r\nembarrassing stories about each other and laugh over them. i\r\nthink we\'re probably having steamed chicken and rice, with\r\nginseng soup, and some gailan.','my artistic friends who chose a life of penury and\r\nmisunderstanding in order to pursue a goal greater than\r\nthemselves, or even this life','jade law1.jpg|jade law2.jpg|jade law3.jpg|jade law4.jpg|'),(21,'Jaime Ng','3rd Yr.','2 including this one.  I decided to take this question seriously\r\nthis time.','A good one.','To get my daily serving of Rice ... No questions asked!','How to properly have intercourse with my fears.\r\n\r\nI\'m not there yet, still in preparation.','I\'m a very active person.  I love Martial arts and I love\r\nBasketball.  Ask me to shoot hoops with you and get skooled!','Going to crazy places at random times (like boomers or golfland\r\nat 9pm).  Or just chilling with some friends and driving around\r\nenjoying the peace and quiet of the night.','Rob a bank and mail it to my relatives in China.','In my sleep.  Preferably having a good dream.  \r\n\r\nBut if you\'re talking about best way to leave this world, I would\r\njust say.. REMEMBERED.\r\n\r\nFor something you have done that made a difference to people.','We\'re in a Love-Hate Relationship.  But deep down, I like\'em\r\nthough I hate them for giving me reasons to procrastinate.  But\r\nreally, it\'s nice to know what\'s going on with your \"friends\"\r\nrather than always being in your own world and concerned only\r\nabout yourself.\r\n\r\nNice to stop and notice that there are others around you and that\r\nthe world will continue to spin regardless of what\'s going on\r\naround YOU.','Def. HOMER SIMPSON.  The guy lives his life through luck.  He has\r\nthe better house and the better life.  Though maybe peter\r\ngriffin\'s kid can annhilate the entire simpson family.  But if it\r\nwas solely them two.. DEF. HOMER!','Beef Chow fun!! =)).','My Mom.  Coming to America and being born in America was not an\r\neasy journey, so to be able to do all that and by herself is the\r\ngreatest and most heroic thing that any mom can ever achieve.','Jaime Ng1.jpg|Jaime Ng2.jpg|Jaime Ng3.jpg|Jaime Ng4.jpg|'),(22,'Simon Shen','1st Year','1st','Econ, maybe Business.','Cuz I heard that there were hot asian chicks in it.','I hope to become a better actor, become more comfortable with\r\nmyself on stage, and pick up some hot chicks on the way. ','Tall. Dark. Handsome.\r\n\r\nOkay maybe just tall. ','One that I wake up on Saturday afternoon with no recollection\r\nof... besides a few bruises and the unibrow that some bastard\r\ndrew across my forehead.','Go to People\'s Park and hang out with all the cool people there.','By holding your breath. For a very long time. While smothered in\r\nelephant dung. ','Makes me feel like a loser cuz nothing is ever on it besides\r\n\"Simon wrote on his own wall\".','Sorry I don\'t really know about historical figures. Was one of\r\nthose guys King of Denmark?','Bu Neh Neh.','I admire any asian who has made it into major theatre and/or film\r\nwhile not being typecast as the kung fu guy with the funny\r\naccent. Apparently, it takes more talent to play an everyday guy\r\nthan to perform roundhouse kicks while cracking witty punch lines\r\nwhile battling the mafia boss who wants to destroy the world.','Simon Shen1.jpg|Simon Shen2.jpg|Simon Shen3.jpg|Simon Shen4.jpg|'),(23,'Jeena Yi','4th','3rd semester yO!','Landscape Architecture major\r\nTheater and performance studies minor','because its fun fun fun. and there are sexy people in rice.','become a better actor and performer. meet some awesome people and\r\ncreate beautiful memories','i\'m Jeena. don\'t spell my name wrong. or i\'ll have to give you a\r\nmean hard glare. ','hmm...lots of food, alcohol, my roommate, lots of blankets, and\r\ndelicious desserts. oh and a stack of DVDs of all my favorite tv\r\nshows. ','go back home to LA and be with my family. ','happy','whatever. facebook does not rule my life, there are far better\r\nthings to think about then to worry whether or not someone i\r\nknow, knows that i left a message for someone else. ','Homer Simpson. he\'s OG. ','korean BBQ with those noodle like wraps you put around it. damn\r\nthat stuff is delicious. oh and steak, medium rare. the bloodier\r\nthe better. yumm....my mouth is watering....','my parents and my brothers. they\'ve each sacrificed and struggled\r\nso much. they\'re my heroes. ','Jeena Yi1.jpg|Jeena Yi2.jpg|Jeena Yi3.jpg|Jeena Yi4.jpg|'),(24,'Leigh Loper','2nd','2','Political Science, Interdisciplinary Field Studies Major','looking to find my own thing outside of my friends, as well just\r\ns flail around.','learn more about improv, keep pushing myself.','a diva.  that basically sums it up.  oh, and sometimes i have an\r\naccent.','a fancy-jancey dinner party with friends','call all of the people i care about and tell them that i love\r\nthem.  then maybe i would do some hard drugs? i don\'t know.','in a terribly tragic cooking accident.  maybe i would be burned\r\nto death by molten sugar while trying to create a spun sugar\r\nsculpture.','I am sad to say that I am getting used to them...','who?  i guess it doesn\'t really matter as long as it is an epic\r\ncage match to the death.','basically, anything in the dairy category.  ice cream, cheese,\r\ncreme brulee...mmm...','my fahjah.  he\'s the business.','Leigh Loper1.jpg|Leigh Loper2.jpg|Leigh Loper3.jpg|Leigh Loper4.jpg|'),(25,'Janelle Jovellanos','2nd','two','Psychology ','I wanted to immerse myself in the collegian experience and join a\r\nstudent organization on campus.  I stumbled on to the Theatre\r\nRice website and thought \"Wow, this looks like very cool,\r\nprogressive and incredibly attractive group.\"  And so I joined.','I hope to gain insight to myself, leadership skills, the ability\r\nto fuck all my fears, and a lot of friendships and wonderful\r\nmemories.','I\'m just a plain jane.','Watching a really good movie with friends.','Indulge in everything that makes you feel really good but is bad\r\nfor you. One example would be to eat a whole carton of Hagen-daz\r\ndulce de leche ice cream.\r\n','without any regrets.','hmmm... don\'t really care... i could do without them','homer simpson.  you can\'t mess with a classic.','Fresh baked chocolate chip cookies. Preferably with a glass of milk.','My mom, the most generous hardworking person I know.  \r\nAnd everyone else who isn\'t afraid to follow their dreams.','Janelle Jovellanos1.jpg|Janelle Jovellanos2.jpg|Janelle Jovellanos3.jpg|Janelle Jovellanos4.jpg|'),(26,'Allen Chang','Junior','2, including this one','Mech E','Too fun to resist','How to act better, make new friends','I\'m really open minded, love vanilla bean ice cream, watch WAY\r\ntoo much anime, have a schizophrenic heart beat, fold cranes\r\nfrequently, and my ears turn red individually. ','Becoming the human blob and getting absolutely no work done','uhh... what\'s with this morbid question? ','AGH! Morbid question number 2! I guess in exchange for another\r\nmore important life','That\'s better. Mini feeds? What are those? are those the messages\r\nthey post about EVERYTHING ANYBODY DOES ALL THE TIME? ','They\'d stop after about 2 minutes from physical exhaustion, then\r\nhave their hot wives take over. Either that or Peter would get\r\nsidetracked by the chicken.','*see above*','Off the top of my head, I admire Jet Li. He encompasses almost\r\nall the qualities that I find to be admirable. He\'s also just too\r\ncool for school. ','Allen Chang1.jpg|Allen Chang2.jpg|Allen Chang3.jpg|Allen Chang4.jpg|'),(27,'Kenneth Tan Ronquillo','The Ox','4 and going strong!','Public Health, Creative Writing minor','I have completed every Sudoku puzzle known to womankind/mankind.\r\n Papa needed something else to do.','Enough to get through finals?  Just kidding.  I would like to\r\ngain a super power.  And I hope it\'s something sassy, like the\r\nability to digest lactose, or teleportation, or maybe something\r\nmore practical, like shooting lazers from my mouth.','Nothing special.  I really identify with Pluto.','Just getting together with friends and studying...oh wow, NERD\r\nALERT.  Ok, let\'s go there.  We would all be writing O-Chem\r\nprelabs on X-Men contact paper in-between alternating rounds of\r\nMagic: The Gathering and Dungeons & Dragons, taking breaks only\r\nto level up our shamans on WoW.  Whew!  Where\'s my inhaler? \r\nThat\'s exciting.','Construct a time machine--MacGuyver style, using only paper clips\r\nand perseverance--to catapult myself into the day after tomorrow.\r\n If that is not possible, I would at least concoct a new Math\r\nTheorem to, ya know, leave something behind to remember me by.','Over something petty. Like snakes on a plane.','Delicious.  I am stalking myself on facebook as we speak.  I see\r\neverything I do!','OJ Simpson','Whatever is in front of me.  Ain\'t no whining at the Ronquillo\r\ndining table!  That\'s a little trick I inherited from my Third\r\nWorld parents.  Others include: catching dragonflies by their\r\ntails, eating rice with my hands, and adding water to the shampoo\r\nbottle to make more shampoo.','All jokes aside, I really admire my grandmother and my parents. \r\nThey were born in bamboo huts in the Philippines and, by some act\r\nof God, they managed to start new lives in American suburbia. \r\nThat brand of ambition and resourcefulness and fearlessness\r\nastounds me.  They are fighters.','Kenneth Tan Ronquillo1.jpg|Kenneth Tan Ronquillo2.jpg|Kenneth Tan Ronquillo3.jpg|Kenneth Tan Ronquillo4.jpg|'),(28,'Ernesto Candelaria Manacop Junior AKA \"Jun\"','My last semester!','This be my 6th semester!','Molecular and Cell Biology with an Emphasis in Immunology','To feel wanted.  Seriously.  I was going to drop out after two\r\nmeetings, but I ended up loving it, and here I am.  Assistant\r\nf***in\' Producer.','I want to learn to not go crazy when thinking about the\r\noverwhelming odds against me.','I\'m 23 yrs old.  A Cancer.  A global citizen.  A\r\nrealist/idealist.  In love.  Very blunt and honest.  Charming.  A\r\nVERY huge X-Men fan.','Catch up with all my schoolwork.  Or watch movies.  I don\'t\r\nreally party anymore.','I\'d call all the people I care about and say what I have to say\r\nto them.','On acid.','','','Anything I cook since I\'m a fabulous cook.','My parents because they raised my pretty well.  And Bam and\r\nKiwi... because they rep for Filipino hip-hop.','Ernesto Candelaria Manacop Junior AKA -Jun-1.jpg|Ernesto Candelaria Manacop Junior AKA -Jun-2.jpg|Ernesto Candelaria Manacop Junior AKA -Jun-3.jpg|Ernesto Candelaria Manacop Junior AKA -Jun-4.jpg|'),(29,'Stephen Hu','Fourth','Third','TDPS','\"Hey Theatre Rice, let\'s team up!\"','EP','I have a pair of eyes that are relative to my ears. They are\r\nabove my nose. That is above my small mouth. And all of this is\r\nbelow my hair, which is on top of my head. My head rests on the\r\nbase of my neck which is supported by the spinal system of my\r\nbody. That is connecting and supporting the rest of my body. one\r\nsystem in my body that is of great concern is my digestive tract.\r\nmy stomach lies in the middle however sometimes can feel sickened\r\nby excess amounts of toxins or spiced foods. this results in a\r\nlabored and painful process through out the latter half of my\r\ndigestive process, which usually constitutes a rubbing of the\r\nstomach with my left hand. this left hand is connected to my\r\nforearm which is connected to my elbow which is connected through\r\nthe tricep and the bicep. both of which are not rightfully\r\nproportional to the rest of my body. this is connect to my\r\nshoulders which aid in the structure of my body. my right arm is\r\nsimilar to my left arm. there are of course differences in\r\ncomposition as my left arm hair is slightly more unkempt compared\r\nto the right. also there are fewer moles however less dexterity.','This is a multi-variabled question. But a general construct\r\nconsists of no class, sleeping in until 11, some physical\r\nactivity, and having a bout of in n out #3 plus a milkshake.\r\nWhere we go from there I leave to you. Since this system is\r\nindeed one dependent on a variable factor, there can be no truly\r\nideal day. Although, one can still speculate as the term of ideal\r\nmakes the hypothetical sitution one that doesn\'t have to be\r\nrealized. In this case, one can argue that the day will be 48\r\nhours however not feel that way. many activities can thus be\r\nachieved in this time frame. the night time will comprise of an\r\nentire day in itself. But obviously, if one has so much time to\r\nspeculate on this subject matter, one is not making use of his\r\nFriday Night efficiently, in all aspects of the social,\r\neconomical, and self-actual content.','If you strike me down now, I will be stronger than you can\r\npossibly imagine','It is not this day. This day, we fight!','See question 9.','The two live in different planes. HOW DARE YOU CROSS THEM!','In an episode of Battlestar Galactica, there is only one\r\ncommanding military vessel left. This oversees the operations and\r\nis the vanguard of the entire fleet. because it is a military,\r\nmercury class vehicle, the Galactica was created for long treking\r\nmilitary operation while other ships of the fleet were not, as\r\nthey were marooned in the process of the genocide of their\r\ncolonies. 12 planets in all. Through this act, the fleet of a\r\nremaning ~50,000 survivors are forced to traverse across the\r\nunknown space with little food and little supplies. Since the\r\nmilitary vessel is equipped for such a journey, it holds a great\r\namount of water supply and replenishes through water filtration\r\nand recycling. But after a cylon sleeper agent is activated, she\r\nsneaks into the water reserve and system and plants 5 G4\r\nexplosives, destroying the hull and venting more than 60% of the\r\nwater supply into space. As a result, the rest of the fleet can\r\nno longer dock with the Galactica to replenish their own water\r\nsupply. They are forced to ration and many are suffering from\r\ndehydration. The fleet will go into epidemic dehydration if a new\r\nsource of water is not located in 3 days. At such a time of need\r\nof even the most basic element of survival, how is it possible to\r\nthink about one\'s favorite food?','Admirals. Just think of the etymological underpinnings!','Stephen Hu1.jpg|Stephen Hu2.jpg|Stephen Hu3.jpg|Stephen Hu4.jpg|'),(30,'Diana Chen','fourth','1','I\'m a psycho premed! (psychology and premed, or you can take it\r\nthe other way too)','I like anywhere that\'s it\'s socially acceptable to pretend you\'re\r\nat a flea circus and holding up the tent with your feet. Also,\r\nI\'ve always loved the stage and I have a deep passion for\r\nsinging, and perhaps acting too. I think it\'s so awesome and\r\nhilarious to see Asian Americans performing comedic/dramatic\r\nfeats on stage and I am thrilled to be a part of it.','I hope to be able to expand my horizons and to express myself\r\ncreatively. I want to connect with the wonderful family of\r\nTheatre Rice. I hope to be able to speak from the heart in my\r\nperformances and really connect with the audience. ','I\'m intuitive, compassionate, creative, effervescent, and\r\ndetermined. And I\'m beautiful. \r\nI\'m also very humble. ','Bonfire, singing without inhibition, volleyball (all at once, if\r\nyou prefer) at the beach with people I adore! And then a quick\r\ntrip to France for caviar and witty banter at cafes. And then\r\nlots of salsa dancing to live music until you get all sweaty.\r\nLying underneath the stars and drifting off to sleep. ','I would go to a concert, kick the headliner off stage and start\r\nsinging. Whoo! I\'m a star!!! \r\n\r\nActually, I would visit my family and close friends and just be.\r\nIt\'s great to love and be loved. ','surrounded by loved ones, feeling at peace with yourself and the\r\nworld. and perhaps, overdosing on chocolate as well. ','Haha... oh silly questionnaire. Mini-feeds are kind of annoying,\r\nlike flies buzzing, but I can get used to it. ','Peter Griffin defeats Homer in the heroic Battle of the Drunken\r\nClam any day! \r\n\r\njust for kicks:\r\nPeter: Oh my god Brian there\'s a message in my Alphabits! It says\r\nOOOOOO. \r\nBrian: Peter, those are Cheerios.\r\n','I know it sounds plain, but I love snacking on stuffed olives and\r\nbread. And I also love avocado on just about everything. And I\r\nlove champagne. Oh, and tiramisu. MMmmmm.','My grandmother. She\'s the best. I want to be an adorable old lady\r\nwhen I grow up. ','Diana Chen1.jpg|Diana Chen2.jpg|Diana Chen3.jpg|Diana Chen4.jpg|'),(31,'Yue Tu','2009','Virgin','Industrial Engineering & Operations Research (IEOR)','I found the members of Theatre Rice were very spirited and good\r\nhumored. It\'s a great change of pace\r\nfrom school and lengthy algorithms. Plus, theatre isn\'t too\r\nbad... although I haven\'t any prior\r\ntheatre experience. Gonna give a shout out to Humorous\r\nInterpretation and Duo Interpretation. N*F*L\r\n(National Forensics League). I also want to thank current Cal\r\nEECS major and Webmaster Anthony Wee (and former Speech president\r\nof Leland Speech of Debate) for introducing me to Theatre Rice.','Like other Ricers, I hope to build enduring ______ (blank1),\r\nlearn new methods of ______ (blank2),\r\nand release built up stress in my _____ (blank3).\r\n\r\nblank1 (all answers are possible):\r\na) friendships\r\nb) trust\r\nc) Harolds (long form improv)\r\nd) Sex\r\n\r\nblank2:\r\na) theatre\r\nb) improv\r\nc) performance\r\nd) Sex\r\n\r\nblank3:\r\na) brain\r\nb) quadriceps\r\nc) lungs\r\nd) loins','NFL Scouting Report Class of 2009\r\n\r\nHeight: 5\' 8.5\" \r\nWeight: 140 pounds\r\nPosition: L/R OLB, WR (Outside Linebacker) (Wide Receiver)\r\n40 Yard Dash: 4.9 sec\r\nBench Press (225 lbs): 0 reps\r\nVertical: 32\"\r\nBroad Jump: 12\'\r\nWonderlic Test: 50/50\r\nStrength: Good defensive awareness and reaction time. Able to\r\nbreakdown plays before they happen. Good team spirit and a media\r\nwhore. Deep understanding of the game. Determined to make you laugh.\r\nWeaknesses: Will not succeed at the NFL Level. Couldn\'t tackle a\r\nstuffed animal. Will not succeed at the\r\nNCAA level. Doesn\'t have the strength to move past linemen. Will\r\nnot succeed at the high school level. \r\nPossibly doesn\'t have the aggressiveness to tackle even NFL\r\nEurope players.','Ideal Friday night would be spending it with lots of my closest\r\nfriends, joking, laughing about current events, \r\nsuch as Screech\'s (Dustin Diamond from Saved By The Bell) new Sex\r\nTape. Or playing co-ed soccer/football.','Call mom and dad. Call Iqwak Bhurji (duo partner, brother, monk,\r\nBoyd Graham, built pyramids together, both interested in Alex\r\nEllis) currently studying at UCSD.','I answered this question in 6th grade in a speech class with my\r\ngood friend and current Cal student: Shahid Syed, who also has a\r\ntwin brother, also at Cal, Wahid Syed.\r\nMy answer remains the same: sleeping pills. However it would be\r\nnice for all my friends on facebook to die with me.\r\nSorry guys. Sorry Sarah Kabiling, happy 19th birthday still.','It\'s cool. I got no beef with it. Zuckerberg & CO. got it figured\r\nout. They know what makes money. Mini-feed increases\r\nclickage by a few hundred percentages I\'m sure. \r\nSpeaking of Harvard alums, if anyone has a job for a former\r\nHarvard alum 2003 who studied American history please let me\r\nknow. She\'s hot and her name is Helen. (I promised her that I\r\nwould help her find a job).','An epic battle, FOX would triumph. In a short 10 minute\r\nscuffle...I\'ll put money on Homer.\r\n\r\nI will take #12 to give a shoutout to the Hammons.','Chinese food if prepared by parents or skilled cooks. Italian\r\nfood if prepared by real Italians. French food if prepared by\r\nreal French. Indian food prepared by REAL Indian people (and I\r\nain\'t talkin\' about Squanto).\r\nListen, I love cooking. ','I admire my parents. They are my greatest teachers and I\'ve\r\nlearned more about the world from them than all of the others\r\ncombined. Needless to say, I wouldn\'t be here if it weren\'t for\r\nmy parents. I also admire all those who use their noggins and think. \r\nI admire my current IMPROV group for having the balls to do\r\nIMPROV, and especially the gals.... since they aren\'t born with\r\nballs to begin with.','Yue Tu1.jpg|Yue Tu2.jpg|Yue Tu3.jpg|Yue Tu4.jpg|'),(32,'Annie Mai','Senior/4th year','2nd semester, Fall 05 baby!','French, PEIS (Political Economy of Industrial Societies, yeah,\r\nit\'s a mouthful, not as bad as the PENIS major, you\r\nknow...non-industrial?!)','Really, why did I? Because I saw Jeena and Ken in \"The Funeral\r\nParlor\" during Spring 05 Midsemester Show, and I thought they\r\nwere so amazing. I joined Theatre Rice because it was a welcoming\r\ncommunity with great people where I could learn more about acting.','I hope to make new friendships and feel more comfortable with my\r\nacting abilities. I would also like to F*ck my fear. I\'m prepared\r\nto laugh a whole lot.','Someone told me once they never realized how short I am because I\r\njump around so much. Daniel Karlin called me \"The Coolest Jew who\r\nknows Kung Fu.\" Except I\'m not Jewish (I wish I was), and I don\'t\r\nknow Kung Fu (but Taekwondo).','Going down the hill to Kip\'s with some of my sorority sisters. I\r\ntry to take Pepcid AC an hour before so that I don\'t get the\r\nAsian Glow after one drink. Sometimes, it\'s successful.','I would say I love you and goodbye to all the people I care about\r\nthe most. I think fornication before you die is necessary too. I\r\nwould also try to do things I\'ve always wanted to do, like\r\nbungee-jumping, base-jumping, sky-diving, maybe I\'ll die that way\r\ninstead. ','Quick and painless, but with advance notice please. So I can say\r\nmy proper goodbyes.','At first, it hurt my eyes to look. I thought it was funny that\r\nsome change to Facebook made it on the Wall Street Journal. I\r\nchanged the option on My Privacy just so people wouldn\'t know\r\nevery single thing I do.\r\n','An epic battle of what? You have to be specific here. Because in\r\nan epic battle of breast-feeding, it would probably be Peter\r\nGriffin. Stewie\'s reaction after realizing he has just suckled on\r\na male nipple and extracting a hair from his mouth is priceless.','Cheesy sticks, oh my god, they\'re so good. Sometimes, my sorority\r\nsisters and I will order them during the wee hours, and write our\r\nnames with grease imprints of the cheesy sticks on the side of\r\nthe pizza box.','I admire my parents the most. Like any other kid, I am thankful\r\nfor all that they\'ve done and are going through. I don\'t know how\r\nthey do it, I won\'t ever be able to live up to it, but I love\r\nthem to death.','Annie Mai1.jpg|Annie Mai2.jpg|Annie Mai3.jpg|Annie Mai4.jpg|'),(33,'Erin Jerri Malonzo Pangilinan','Junior transfer student from UCSC (3rd)','This is my debut semester in TR. ','Asian American Studies / possible double major in Ethnic Studies \r\n','I joined Theatre Rice not only because I was accepted obviously,\r\nbut because I believe that they can carry out their mission\r\nstatement which is to address the underrepresentation and\r\nmisrepresentation of Asian American images in the mainstream\r\nmedia. I believe that Theatre Rice makes a political statement\r\n(not necessarily always talking about race) by showing that Asian\r\nAmericans can just have fun on stage, act, and do what they want\r\nto do their way...whether that\'s making fun of Stanford kids or\r\nmaking a Sex and the City inspired piece.  ','I hope to learn the many different aspects of acting and tips on\r\nhow to become more comedic. I also hope to gain an experience\r\nthat will get my writing a bit away from the \'oh I\'m so angry\r\nlittle Asian girl that does spoken word\' since that is what I\'ve\r\nbeen exposed to so much. ','Angry little Asian American/Filipina American girl that does\r\nspoken word.\r\n\r\nAnd likes anime. ','Dinner and a movie....and sleeping. ','I would play texas hold \'em poker until I win hella money or pull\r\na heist like Ocean\'s 11/12 and donate it to Asian\r\nAmerican/Filipino American community organizations. ','Painlessly. ','I think the facebook mini-feeds not only relate to the whole\r\n\'stalker\' \'1984\'s Big Brother meets FOX owned myspace yucky ads,\'\r\nbut also provides you with a heads-up if you\'re going to see\r\nsomeone at an event (someone who you added is a friend that you\r\nknow--but don\'t really like). This is probably the only good\r\nthing about facebook mini-feeds, they aren\'t all that great. What\r\nwould happen if you broke up with your significant other and your\r\nfriends asked you about it and it was annoying cuz you didn\'t\r\nwant to talk about it!? Also, it should really be used to show\r\nYOUR own mini-feed about yourself TO YOURSELF, but not to the\r\nwhole world. ','Homer Simpson, he\'s classic. ','Filipino spaghetti with pineapples and sliced hot dogs.\r\nChestnuts, sorbet ice cream, acai smoothies with granola,\r\nchocolate covered strawberries, brownies, sour worms/things,\r\npearl tea, laughing cow cheese, cheesecake factory food, Thai\r\nchicken pizza from CPK, bento...AND RICE!','I admire John Cho, Margaret Cho, Rex Navarrate, daria, and Chuck\r\nPalahniuk (author of Fight Club) the most because they are funny\r\nand intelligent--witty! ','Erin Jerri Malonzo Pangilinan1.jpg|Erin Jerri Malonzo Pangilinan2.jpg|Erin Jerri Malonzo Pangilinan3.jpg|Erin Jerri Malonzo Pangilinan4.jpg|'),(34,'Angela Ren','First','1','Bioengineering.','I always liked to act out plays and musicals, but I was a loser\r\nand  had no friends, so I\'d play all the parts myself. That got\r\nto be kind of pathetic. So I joined Theatre Rice. And now I have\r\nmany friends to act with. It\'s just a bonus that they also happen\r\nto be amazingly funny and talented people. ','Doing things I\'m afraid to do. Surpassing my own expectations for\r\nmyself. ','I\'m just another girl, fueled by coffee and crazy ideas. I enjoy\r\nreading facts about presidents, like how Chester A. Arthur owned\r\n80 pairs of pants and changed them several times a day. I think\r\nhe sweat too much. ','Going on a midnight adventure, in the woods or in the city. Then\r\ngetting lost with good friends and a bucket of chicken wings.','I\'d go home to my family, garden with my dad, cook with my mom,\r\nand ribbon dance with my 3-year-old sister. Things that I should\r\nbe doing anyway, but I don\'t do enough of.','When I\'m old enough to wear dentures and shoulder pads. And a\r\nbonnet. And surrounded by loved ones. ','They make stalking my friends easier. I kid. ','Homer. ','Cashews.','Anyone who can love wildly and risk everything. Because it\'s the\r\nmost exciting way to live and I wish I can do that.','Angela Ren1.jpg|Angela Ren2.jpg|Angela Ren3.jpg|Angela Ren4.jpg|'),(35,'Aly Wong','1st year ','1','undecided (English/premed)','Because it\'s AMAZING.  ','','I am Chinese girl, average height, average weight.','Dinner and a movie with that special someone.  ','I would stop everything I was doing, stop for once in my life,\r\nand spend that one day telling the truth.  ','Happy.  ','They are my guilty pleasure.','who?','A perfect yellow, firm, but not too hard, fuzzy peach. ','I admire my father because he\'s a man of integrity.','Aly Wong1.jpg|Aly Wong2.jpg|Aly Wong3.jpg|Aly Wong4.jpg|'),(36,'Diana Halog','It\'s the Age of Aquarius- I rule.','Officially my first. Does it count that I\'ve been in a skit\r\nrandomly and have fervent adoration for some old ricers?','Sociology (and working on a 2nd one)','Well all the cool kids jumped off the bridge, so pondering life\r\nwith my alone with my life-saving outsider mentality gave me time\r\nto try out for TR. \r\n\r\nGo Asian/Asian Americans in charge of their own representation! Whoo!','Skillz. Something cool enough to warrant a mid 90s cool \"z\". The\r\n90s were the best decade (and the late 80s count too). ','\"I am an iceberg.\"\r\n','Well, me suddenly in legal possession of one million dollars on a\r\nsunny beach tanning myself while I make flirty eyes at my cabana\r\nboy... WHAAAT? You mean something that could actually happen?\r\nHaving deep conversations and watching good movies with friends.\r\nOr just sleeping.','Tell all the people I love that I love them. Tell some people the\r\ntruth. Eat gluttonously at expensive gourment places. Go to the\r\nbeach. And skydive because I finally wouldn\'t be afraid of dying, eh?','Old and with a full life. Or kicking butt. Or in some way where\r\nthey would make a musical of my life. Just not a made-for-TV\r\nLifetime movie, please.','They need to die. Next question. P.S. See TR Workshop Facebook\r\nskit- that about sums it up.','Griffins just ask you weird questions about time and men. But\r\nthey can kill you so points for that. What did Homer do? Homer\r\nwrote poetry on papyrii. Papyrii >>>> death. Therefore, Homer wins.','Chocolate. If I had to give up one thing either chocolate or meat\r\nfor the rest of my life- I would give up meat gladly. And I likes\r\nme some meat. And Paneer Tikka Masala with garlic naan and rice. Mmm.','Strong intelligent women like my mom and sister. People who have\r\nsurvived life and are happy. Movers and positive changers.\r\nMalcolm Reynolds. Alan Tudyk. Joss Whedon. And pirates, yarr.','Diana Halog1.jpg|Diana Halog2.jpg|Diana Halog3.jpg|Diana Halog4.jpg|'),(37,'Brian Manaois','Year? How unspecific, so i\'ll answer this a couple of ways:\r\n- I\'m a 4th year in college\r\n- I was born in 1985 aka the year of the Ox\r\n- The current year is 2006','It\'s my 1st semester!!','Double Major in Sociology and Economics. Woot.','I love theater and i love rice. Put it together and you got\r\ndouble the awesomeness. And i wanted to be part of that\r\ndouble-awesomeness-ness. ','I hope to push myself to see what i\'m capable of doing that i\r\nnever knew or thought i could do. And meet cool people to joke\r\naround and laugh with along the way.','I\'m awesome. Not just plain awesome, but a\r\nquirky-funny-loves-to-eat-a-lot-and-is-shorter-than-most-people\r\nkind of awesome.','Ghost hunting. Really.','Hug everyone i know one last time. sappy, i know.','Guillotine. You\'re someone special if you die by guillotine. Oh,\r\nbut the blade has to be really sharp because if it isnt, then the\r\nblade doesn\'t go all the way through and then they have to do it\r\nagain because you\'re not dead all the way, so it kinda ruins the\r\nmoment.','It took all the fun out of stalking people. Back in my day,\r\nstalking took effort.','I can\'t choose, but i would pay to watch that battle.','Chicken Tikka Masala. Mmmmmmmm.','My grandmother. She basically took care of and raised me when i\r\nwas a kid. She is just the best example of love, kindness, and\r\nall the other good stuff. ','Brian Manaois1.jpg|Brian Manaois2.jpg|Brian Manaois3.jpg|Brian Manaois4.jpg|'),(38,'Charles Lee','4th','4','Pornography','For the people.','Hopefully befriend some beautiful and smart people.','Hmm...I can speak Japanese but Im Korean and I cant speak Korean\r\nthat much. \r\n\r\nIm the oldest ricer this semester which I thought would NEVER\r\nhappen. Its all good though~\r\n\r\nI\'d say Im trustworthy. I dont talk much but I do listen. I\r\nponder about things that doesnt really make sense in the end. I\r\nlike to see people wash their hands. I have a weird obsession\r\nwith compasses and clocks. ','My ideal friday is to go out to a club with my best buddies and\r\ngals, drink until we die, dance like there is no tomorrow, make\r\nout with someone hot, go out to late night Jack in the Box\r\nafterwards and feast on geased up junk food while we laugh about\r\nthe stupid things we\'ve done.','I would go run forever. I dont care if I get lost, I\'ll just keep\r\nrunning.','In your sleep','Facebook is too complicated now. I\'d rather not deal with it anymore.','Peter Griffin...I dont know why...I just like him. HAHA','Japanese curry','Hmm...dont wanna get too sappy. i would say God. Hes awesome.','Charles Lee1.jpg|Charles Lee2.jpg|Charles Lee3.jpg|Charles Lee4.jpg|'),(39,'Betty Boop (Beverly Hong)','Boop boop be doop (translation: class of 2007)','2','Integrative Boopology','I had too much boop boop in my humps so I thought to share my\r\nwealth with others who are equally as fun and frivolous as I am. \r\n','I hope that we will all learn to be kind and loving towards our\r\nfellow man and adopt all the hungry homeless children of the world.\r\n','a candle that burns endlessly, just dont open the window.','when the library is open past 10pm.','breath as much as i can.','not knowing when you\'re going to die.','they\'re starting to grow on me. I just know that whenever i go on\r\nfacebook now, I have to set aside at least 3 hours. \r\n','Peter Griffin, he knows luke perry.','three twins ice cream, madagascar Vanilla','I admire edward scissorhands b/c he never judged anyone. ','Betty Boop (Beverly Hong)1.jpg|Betty Boop (Beverly Hong)2.jpg|Betty Boop (Beverly Hong)3.jpg|Betty Boop (Beverly Hong)4.jpg|'),(40,'Anthony Wee','3rd year ','2','Eecs','Because I always liked acting, and theatre rice is an awesome,\r\nfantastical way for me to learn more about theatre and such. ','I\'m interested to learn more about improv (YES, GO IMPROV\r\nTROUPE!!) and I hope to delve deeper into my acting self\r\nhopefully in a play or something. ','I\'m funny, silly, interesting, unique...everything you\'d want in\r\none package. Biatch. ','Spending time with friends and having a superb time. ','I\'d go skydiving and have a crazy party....after spending some\r\nquality time with my family...they can be there too.','During sex','They feed my inner stalker...mmmyeah','Homer, he\'s got those bulging biceps from strangling Bart, but\r\nPeter will always have his victory over the giant chicken.','oh, gad, I have no idea, I love it all.','My parents for being such amazing people and giving me more than\r\nI could ever ask for.','Anthony Wee1.jpg|Anthony Wee2.jpg|Anthony Wee3.jpg|Anthony Wee4.jpg|'),(41,'Suvachai Sonny Watanasirisuk','Senior (5th year)','Three, counting the current one.','1.  Business Management Economics (B.A., UCSC 2006) (completed)\r\n2.  Mechanical Engineering (B.S., UCB) (in progress)','To prove I am a well-rounded person and willing to go outside my\r\ncomfort zone.  Also, I think it is a dynamic group which is\r\nalways thinking progressively, and because that, I have a\r\nprofound respect for its mission and want to help fulfill its goals.\r\n\r\nAnd also, to meet new friends, especially girls...  LOL, j/k...a\r\nbit...','Definitely, I want to improve my improv skills and figure out a\r\nway to think of creative ideas quicker.  I hate it when I come up\r\nwith ideas after the fact or when it\'s too late to matter.','Love cars, love women, obsessed with thrill seeking and speed.\r\nWhether it may be a lovely road along the coast, a desert\r\nfreeway, or a twisty backroad, I love to express my passion for\r\ndriving. This is especially the case with friends and hopefully\r\nsomeday with a special girl who wants a ride with me through the\r\nroad of life.\r\n\r\nI consider myself a sharp and smart person. One credential being\r\nthat I have graduated from UC Santa Cruz this past June (2006)\r\nwith a B.A. in Business Management Economics. By May 2007, I will\r\nearn my B.S. in Mechanical Engineering. A good combo for many\r\ncareer possibilities in my opinion. Maybe I will finally get\r\nthose corporate sponsors I need to get my racing team off the ground.\r\n\r\nLastly, I also consider myself a well-rounded individual. I write\r\na manga in my spare time, have good debates on deep topics, and\r\nplay most sports. And no, I would barely call rhythmic gymnastics\r\nand golf sports, to be quite honest. ^_^vv','Having an all-out downhill battle (mountain road race) against\r\nwilling drivers and being able to experience the heat of battle\r\nand learning and enjoying the experience of the thrill of being\r\none with your sports car (having control and taking your skills\r\nto the limit).','I\'d spend time with my family, telling them how much I love them\r\nfor believing in me in whatever I want to do and trusting me that\r\nI would succeed in life.','In my sleep, warm in my bed, having the best dream ever.  Or in a\r\nflaming million-dollar supercar or racecar in the heat of the\r\ngreatest battle (race) ever recorded.','I don\'t know...  It\'s informative, but I don\'t check often enough\r\nto really get anything out of it.','Oh man, why this question?  I\'m tired of having to explain why\r\n\"Family Guy\" isn\'t funny.  Having a string of random memories\r\nthat add nothing to the storyline (if there even is one...) is\r\nnot so funny that it works on many levels as \"Simpsons\" episodes\r\ndo.  The same goes for Peter Griffin, very one dimensional. \r\nHomer Simpson FTW; the original, loving father figure that can\r\nwin against Peter.  Homer\'s got vast amounts more charisma than\r\nPeter.  Plus, Peter\'s fatter than Homer and can\'t take punches\r\nlike Homer can.  Homer\'s almost indestructable.  Remember his\r\nboxing career and his ability to take cannonballs to the gut?','It\'s definitely Italian.  Very filling, hearty, and flavorful.','My parents, definitely.  They both embody, essentially, the\r\n\"American Dream.\"  Immigrating to the U.S., working hard and long\r\nto start a family, raising kids to succeed in life and make them\r\nhappy, and retiring with wealth to spare to enjoy what the world\r\nhas to offer.','Suvachai Sonny Watanasirisuk1.jpg|Suvachai Sonny Watanasirisuk2.jpg|Suvachai Sonny Watanasirisuk3.jpg|Suvachai Sonny Watanasirisuk4.jpg|'),(42,'','','','','','','','','','','','','','','');
