INSERT INTO `Fall_2006_Evals_profiles` VALUES (1,'TEST','hello, this is a \"test for test\'s sake\"','','','','','','','',''),(2,'','','','','','','','','',''),(3,'Awesome semester. Loved interactions with Cococo\'s because they \r\nwere so welcoming and friendly, as was the rest of the cast. \r\nThe activities we do are very involving and interesting, and \r\nsooper fun! I\'d have to say that the only weakness I felt was \r\nthat this semester seemed to be crunched for time.. If we maybe \r\nstarted out the semester earlier and worked with our specific \r\ngroups earlier, then time might be a little more spread out and \r\nwe could be more ready for our shows.','I was in Tech for the showcase and things went pretty smoothly. \r\nThe equipment I had to work with was pretty simple and \r\nrelatively easy to work with, except for the fact that some \r\nstuff was a little unstable (spotlight).','I liked the format of the class and the way we start our \r\nmeetings with activities and how we \"bring it in\" at the end.','I loved Adaptation Troupe so doing something like that again \r\nwould be awesome.\r\nI\'m actually seriously hoping to have a small informal singing \r\ngroup within TR and if we get established, we could maybe sing \r\nas transitions between parts of our shows? Just something I\'m \r\nreally interested in and hope to get to work.','I feel totally comfortable with the group as a whole, moreso \r\nwith some individuals than others but as a group, you do an \r\nawesome job of making everyong feel welcome and safe.','Somewhat. I felt that in some cases, my opinion was considered \r\nfor one of the groups according to how big my performing role \r\nwas, which I felt was a mistreatment as someone who was as much \r\npart of the group as anyone else.','Yes! Because I LOVE Theatre Rice. It\'s a place where I can \r\nexpress myself in so many new ways that I have not even thought \r\nof before. It\'s a break from the rest of my monotonous life. :]','Pretty much, yes.','The producer was very chill and it was nice having someone in \r\ncharge who was not uptight about everything.','yay for Theatre Rice! :D'),(4,'awesome community, very supportive of everyone. it gave a safe\r\nspace to let people shine','improv was awesome. i would suggest more exercises to disban fear\r\nof performing','it was very effective','i would like to see more use of musical talent','i feel very comfortable and accepted, thank you','yes','i might take a semester off to strengthen myself academically,\r\nand i probably will return','of course! i am going to miss Theatre Rice so much! This was an\r\nawesome experience and i am definitely changed for the better. ','jeff is crazy!',''),(5,'I loved the cast this semester, though it was extremely hectic\r\nwith all the events going on fall.  For some reason, fall is a\r\nvery crazy semester, as always.','I loved adaptation troupe.  This semester was very high energy\r\nstuff.  Sometimes though, I feel like theatre rice hides behind\r\ncomedy too much and less of the dramatic pieces.  The odd couple\r\ncould have been a potentially dramatic skit but it turned out\r\ncomical.  I don\'t mind it, but I wouldnt mind more dramatic and\r\ndeep or even really sad (tear jerking) pieces.','Format of the class was really good.  I liked the new themes\r\neveryday.  ','','Yes, I felt safe within this group.  It was really fun. ','Yes.  Directors did very well in taking in audience suggestions.','Maybe.  Theatre Rice is really time intensive.','Yes.  I fucked my fears.','Strength: Jeff has a lot of direction & vision on where he wants\r\nto lead the group.  Tasks were well delegated and distributed. \r\nTheatre Rice overall was more efficient.  Jeff kept up with\r\neveryone\'s jobs and roles and ensured that things were done on\r\ntime.  He also helped out a lot and that\'s what made everything\r\nso strong this semester.  Kept up with emails, consistently\r\ncontacted people when they needed to finish certain things.\r\n\r\nWeakness: Producer needs to be meaner.  Needs to be an enforcer.\r\n Think: ASSHOLE.  Ex.  For banquet, don\'t say, we would like it\r\nif you went.  Say everyone HAS to go unless you have a valid\r\nexcuse.  But it is really critical.  We want everyone there.  I\r\nguess just use meaner and enforcing language rather than give the\r\ncast too much freewill.','no.  This semester was really good. Really good xcomm.'),(6,'Pretty Good','','','','','','','','Give directors some background on how to recieve comments.\r\nComments given to directors are unfiltered, and some should be\r\ntaken more lightly than others. So if something\'s a big deal,\r\nmake sure it\'s well articulated; conversely, if something should\r\nbe taken with a grain of salt, that should come across also. ',''),(7,'it was great. i think everything was pretty organized. things\r\nwith the constitution got kinda \"dramatic\" but other then that it\r\nwas great. i especially liked that tech rehearsal\'s were organized. ','film troupe:\r\ni think the direction was not effective. the director did not\r\ndirect the actors but rather re-enacted what he wanted and the\r\nactors were told to copy. It was indicated at the beginning it\r\nwas going to be a group effort and that suggestions for the\r\nscript were going to be taken. there was none of that. in fact\r\nwhen anyone did bring up suggestions or disagreed with the\r\ndirector they were received with a negative attitude or were\r\ncompletely dismissed. some times even blatantly and rudely\r\nbrushed off. Many times i and other members of the group were\r\nleft offended and angered. no one appreciates being talked down\r\nupon or yelled at. i think if this kinda of situation happens\r\nagain, ex-comm should intervene and talk to the director. ','the format was great. it was fun. however i think the group would\r\nbenefit from a uniform repeated warm up. if the group did a set\r\nfew (1-2)warm up every meeting that focused on projection,\r\nbreathing, and body, it would help extremely. since we do random\r\ngames every meeting, nothing is really being achieved. no one is\r\nproperly learning about breathing and voice. which is extremely\r\nimportant considering we\'re a theatre group. ','i\'d really like to see more self written work and scripted work\r\nthat has an actual beginning and ending. not just a scene from a\r\nfull length play. if we\'re going to do scripted work, lets do it\r\nright. do a short play from beginning to end, and get the rights.\r\nwe can afford it. its not that expensive, especially if its short\r\nand we\'re only doing it for two nights. \r\nin terms of exercises, i think a breathing and voice exercise is\r\n really key. like doing the same three tongue twisters each time.\r\nand doing a relaxation breathing exercise. also, if we\'re going\r\nto do a lightening circle, it needs to be emphasized that the\r\npoint of the lightening circle isn\'t just to go super fast. but\r\nto go right after the person before you and mimic that action\r\nperfectly. its about precision,watching another person, and\r\nseeing the intricate details. however this is just my opinion. \r\nand i am definitely interested in directing a scripted piece. how\r\ncan i propose that?','yes i did. i wish i could have gotten to know more ppl, but with\r\na cast of 40, i think it was pretty good. ','yes for midsemester. not really for showcase. i really had to\r\nfight hard with the director to get my voice heard. but the\r\ncococo\'s were awesome, and so was assprod and prod, as well as\r\nCT. everything was great. ','yes. i heart rice. ','i want to direct something in rice and have wanted to for quite\r\nsometime now, but haven\'t found a project to really want to direct. ','just be a little more organized with the constitution meeting.\r\nsome people seem to have really gotten annoyed with that. i\r\ndidn\'t, but i understand why. but i think he handled it well by\r\nadmitting he made a mistake. no ones perfect. and overall i think\r\nhe did a great job. he was friendly, but still got the work done.','like i said earlier, a voice and projection excercise done at\r\nevery meeting will really help with rice. not to mention decrease\r\nthe amount to yelling \"project\" when showtime comes around. its\r\nsomething that needs to be taught and practiced. not just shouted\r\nout from the audience. that tends to ppl just shouting and\r\nstraining voices. Also i\'d like to see plays and self written\r\nwork be rehearsed and worked on for at least a month and a half.\r\nnot 3 and half weeks. its just not enough time to properly put on\r\na show. two months would be even better, especially with scripted\r\nwork. '),(8,'I think it went pretty well.  My only comment about this is\r\ncontinuing the gung-ho-ness into Showcase if there are two shows.','I felt that each director had their own way of doing things, but\r\nthis is great because it adds to the flavor of Rice.  I think\r\nsomething more could be done in the beginning with the old ricers\r\nto reach out to the new and create a more inclusive community,\r\nthat much sooner.','I love it.  Janelle and J\'amores were awesome.  I would kinda\r\nlike a teaser at the end so we know what to expect (so as to also\r\nmake the sessions seem connected more).','Anything that takes Theatre Rice outside the box is something\r\nthat I would look into.  I was thinking about some form of a\r\ntroupe where props become the focus of various stories or writing\r\nsomething for submission about various facets of what it means to\r\nbe a college student.','I felt comfortable with the group, but I felt connected with the\r\ngroup only after the second show as the different groups made the\r\ngroup as a whole seem very disconnected.  There were a lot of\r\ncliches, which though inevitable, might be minimized somehow.','I feel as though Theatre Rice, despite what\'s happened, is a most\r\ndemocratic organization.','I do because it is the one place where I feel loved and accepted\r\nat Cal... seriously.','I have accomplished my goals this semester.  I look forward to\r\naccomplishing new goals next semester.','I feel as though the Producer could have worked on elections\r\nbetter to make them more equitable and secure.  This said, he is\r\nable to admit mistakes, so that he and we can all learn from\r\nthem.  I couldn\'t think of anyone better from the group at this time.','I want to see Theatre Rice do more experimentation and/or come up\r\nwith material that is even more solid.'),(9,'Strengths: Staff were all leaders.\r\nWeaknesses: Wish there were more time to focus on a specific topic on specific days.  \r\n                    Felt like there were too much events with different goals.\r\n                    Learn more about Asian Americans in Theatre/Film.\r\n                    Lacking in Tech','Improv\r\nStrength: Spent a lot of time together to feel each other out.\r\nWeaknesses: Wish we got to watch professional improvers\r\n                    study/hang out by watching improv shows','The class format was what you expect from a theater class.  I feel the effectiveness was \r\nlimited by the space of the room.  Whenever we make a circle, it\'s difficult to do \r\nexercises because of the lack of room.  Perhaps make use of groups more.  Pick certain \r\nleaders and sections of the room to do different exercises.  Then make use of the the \r\ngigantic circle.','I\'d like to see a tech section/group.\r\n\r\nI may be interested in directing a short 5 minute piece that deals with the Term \r\nOriental for the Final Semester Showcase.','I do not think I can answer this fairly.  I am never comfortable with a group of people.  ','I noticed the old ricers\' ideas were voiced more.  I also heard the wanting of \r\nencouraging new ricers to voice ideas, but the considerations of the new ricers were \r\nnot taken in as much of old ricers.','No.  It is an artistic group I wanted to join from the start of college, but right now what \r\nI  can do is just follow.  I want to build my own confidence in myself and learn more \r\nbefore I join again.  I\'d like to do more than follow.  I want to contribute.','Yes.  I wish I could contribute more to the group.','Nothing that he didn\'t think of.','');
