INSERT INTO `comments` VALUES (1,'Bev','hong586@mail2beverly.com','i\'m here to see what others wrote.'),(2,'Bev','hong','awww man.'),(3,'j','c','it was ok'),(9,'grace','glmalvar@uclink.berkeley.edu','you guys need to update this website.  You don\'t have anything on Open Rice nor the Showcase here.  come on man!'),(10,'Luke Archer','lukearcher@hotmail.com','Every time I\'ve seen your show I\'ve loved it and I just wanted to know if there is anywhere I can download videos.  I know you guys film it but do you release the videos.'),(11,'bill gates','bil@microsoft.com','this site needs a little color, and it needs to get out of frames. \r\n\r\nframes are old skool. '),(12,'John Miyasaki','jacknori@yahoo.com','Hello Friends,\r\n\r\nMy name is John Miyasaki, I am the Artistic Director of hereandnow, and we are trying to put together a Conference of different Asian American College Theatre Groups this August.  For one week representatives from groups all over the country will come together for workshops, seminars, group activities and performances in Los Angeles.  Housing will be provided and other registration cost should be minimal.  We are still putting things together but if you are interested please let us know and we will give you all the details.  You can contact us at:\r\n\r\n     626-375-5219 or jacknori@yahoo.com\r\n\r\nThank you for your time and we hope to hear from you soon.\r\n\r\njohn miyasaki'),(13,'Hellen','helllenNOSPAMPLEASE@mac.com','so is there a way to view comments without having to add a comment?'),(14,'tiffany','tiffany_yang@berkeley.edu','Hey. I LOVED your midsemester show. :) it was hilarious. So now, I\'m inspired to ask how someone could get involved with Theatre Rice? Are there only auditions in the beginning of the fall semester? Thanks!\r\n\r\n\r\n-Tiffany'),(15,'Anna','alau510@berkeley.edu','I absolutely enjoyed Friday\'s show.  The best part was the skit about Doe Library.  Keep up the good work.  I look forward to the upcoming shows!  ')