INSERT INTO `phpbb_forums` VALUES (3,0,1,10,'','Writer\'s Block','Theatre Rice Writer\'s Block Forum','',7,'','','',2,'writers_block.png','','','',7,'',0,1,0,1,1,1,7,57,'qwtqwt',1229301413,'fredericko','',32,1,0,1,0,0,0,365,365,365),(5,3,8,9,'a:1:{i:3;a:2:{i:0;s:14:\"Writer\'s Block\";i:1;i:1;}}','Off Topic','Talk about anything not Writer\'s Block related here. \n\nNew members can also visit this forum first and introduce themselves!','',7,'','','',0,'','This is a safe space. Please be supportive. Keep your feedback as constructive as possible.','','',7,'',0,1,0,0,0,0,0,0,'',0,'','',32,1,0,1,0,0,0,7,7,1),(6,3,2,3,'a:1:{i:3;a:2:{i:0;s:14:\"Writer\'s Block\";i:1;i:1;}}','Announcements','Announcements and board rules.','',7,'','','',0,'','','','',7,'',0,1,0,4,4,4,5,53,'First Writer\'s Block Meeting!',1219788154,'jkregullano','',32,1,0,1,0,0,0,7,7,1),(7,3,4,5,'a:1:{i:3;a:2:{i:0;s:14:\"Writer\'s Block\";i:1;i:1;}}','Post your work here!','Plays, short stories, movie scripts, anything your heart desires.\n\nLet everyone know what type of feedback you are looking for, if any.','',7,'','','',0,'','You have entered a safe space. Be supportive. Also, be as constructive as possible with your feedback. Other than that, pretty much anything goes!','','',7,'',0,1,0,1,1,1,6,54,'My Ramblings',1222197222,'evpallasigue','',32,1,0,1,0,0,0,7,7,1),(8,3,6,7,'a:1:{i:3;a:2:{i:0;s:14:\"Writer\'s Block\";i:1;i:1;}}','Other Things Writer\'s Block','Anything else you want to talk about regarding WB goes here. For example, guest speakers, the inspirational things of the month, what inspires you, favorite movies, books, multicultural issues, etc.','',7,'','','',0,'','','','',7,'',0,1,0,0,0,0,0,0,'',0,'','',32,1,0,1,0,0,0,7,7,1);
